INSERT INTO `Reviews` VALUES (2,49,5,'66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','2db74700-b5dc-11ea-ae50-ddbe5a0ce374','Hope he is back soon again :)',5,NULL,1,0,'2020-07-09 15:29:25','2020-07-09 15:29:25',0,1,'true',NULL,NULL,NULL),(4,0,1,'8b16c890-c205-11e6-a2c7-4195de507451','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','My admin review',4,NULL,0,0,'2020-11-02 16:41:36','2020-11-02 16:41:36',1,1,NULL,NULL,NULL,NULL),(903,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schne, moderne und hochwertige Wohnung. Die Gastgeberin ist sehr herzlich und kommikativ. War ein schner Aufenthalt! (Airbnb review)',5,NULL,0,0,'2021-04-10 08:20:43','2021-04-14 05:42:39',0,1,NULL,'Long-Nong','https://www.airbnb.de/rooms/48268802/reviews','April 2021'),(904,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super Aufenthalt',5,NULL,0,0,'2021-04-10 08:20:43','2021-04-10 08:20:43',0,1,NULL,'Cindy','https://www.airbnb.de/rooms/48268802/reviews','Mrz 2021'),(905,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ich hatte leider einen sehr kurzen Aufenthalt, da ich lediglich auf der Durchreise war. Allerdings kann ich die Location von Elsa nur empfehlen... Alles sehr schick und sauber... Aber vor allem sehr Herzlich... Wrde wieder kommen...',5,NULL,0,0,'2021-04-10 08:20:43','2021-04-10 08:20:43',0,1,NULL,'Andy','https://www.airbnb.de/rooms/48268802/reviews','Mrz 2021'),(906,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Gute Lage, sehr nette Gastgeberin. Leider war ich nur fr kurze Zeit Gast, ich kann mir aber gut vorstellen, dass man dort auch eine lngere Zeit verbringen kann. Nur zu empfehlen.',5,NULL,0,0,'2021-04-10 08:20:43','2021-04-10 08:20:43',0,1,NULL,'Christian','https://www.airbnb.de/rooms/48268802/reviews','Februar 2021'),(965,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schne ruhige und zentrale Lage, sehr sauber, ausreichende Ausstattung- fr einen Kurztrip empfehlenswert!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Madita','https://www.airbnb.de/rooms/31289582/reviews','Juli 2020'),(966,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super sauber und ein toller Ausgangpunkt fr Wanderungen',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Anna','https://www.airbnb.de/rooms/31289582/reviews','Juli 2020'),(967,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Absolute Empfehlung! Die Wohnung war super sauber und gut gepflegt, die Kche war toll ausgestattet, der Blick auf den Gipfel war wunderschn. Gemtlich, man kann toll entspannen, die Lage ist perfekt, man kann super parken und ziemlich alles fulufig in guter Zeit erreichen. Wir sind absolut zufrieden und dankbar GP in dieser Unterkunft erleben zu drfen! Die Gastgeber sind auch freundlich und nett und stellen immer sicher, dass man alles hat, was man braucht, sind gut erreichbar und haben immer ein Lcheln parat. Gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Mirela','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),(968,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','saubere Unterkunft, toller Ausblick vom Balkon. Sehr empfehlenswert!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Patrick','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),(969,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung war fr unseren Aufenthalt in Ordnung.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Lea','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),(970,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung ist wie beschrieben.Sie ist sehr sauber und enthlt alles was man bentigt. Klein aber fein. Die Aussicht auf die Olympiaschanze vom Balkon ist toll. Wir haben uns sehr sehr wohl gefhlt. Die Gastgeber haben uns sehr herzlich empfangen und es lief alles ohne Probleme. Ich kann es nur weiterempfehlen',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Nadine','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),(971,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Positiv: Tolles Einrichtung Super Lage & Aussicht Ruhig Sehr sauber Negativ: Deckenhhe/ Trrahmen fr groe Menschen schwierig Details fehlten wie Pfeffer, Seife. Sehr wenig Kchen Utensilien',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Sren','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),(972,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war alles zu unserer Zufriedenheit. Ruhige und schne Lage mit direktem Blick vom Balkon auf die Skisprungschanze und aus den Fenstern in Richtung Zugspitze. Kommunikation, Schlsselbergabe, usw. haben wunderbar funktioniert. Wir kommen gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Christian','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),(973,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nachdem wir die Check In Zeit um ca. 20min nicht geschafft htten, wurden wir darauf hingewiesen, da nach 20Uhr keine Anreise (laut Richtlinien) mehr mglich ist, welches mir Telefonisch vom Verwalter besttigt wurde!! Deswegen gab es keinen Aufenthalt in der Ferienwohnung!!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Sigmund','https://www.airbnb.de/rooms/31289582/reviews','Mai 2019'),(974,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Unser Aufenthalt in der Kleinen Auszeit war perfekt. Kontakt, Schlsselbergabe, alles perfekt! Die Wohnung ist absolut gemtlich, wir haben uns sofort wie zu Hause gefhlt. Die Lage ist top, toller Blick vom Balkon auf die Berge und die Sprungschanze. Wir kommen gerne wieder!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Andrea','https://www.airbnb.de/rooms/31289582/reviews','April 2019'),(975,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Klasse kleine Wohnung zum Wohfhlen !',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Matthias','https://www.airbnb.de/rooms/31289582/reviews','Mrz 2019'),(976,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Pro:\n- sehr saubere und gepflegte Wohnung/ Ausstattung\n- schne Lage, gute Erreichbarkeit\n- super Blick vom Balkon\n\nContra:\n- Launische, unberechenbare Kommunikation\n- Folgende Situation fand ich mehr als unangebracht: ich war als offensichtlich Schwangere auf dem Weg aus der hier gemieteten Wohnung und sage auch noch, dass wir etwas durcheinander sind und auf dem Weg zum Arzt (ich bin zuvor gestrzt und gehe in meinem Urlaub nicht zum Spa zum Arzt). Anstatt das Sie besorgt/hilfsbereit waren, haben Sie in einem sehr unfreundlichen Ton gesagt, dass das nicht Ihr Problem sei und keine Entschuldigung dafr, dass wir die Balkontr offen gelassen haben (Heizkosten). Wie kann man nur so wenig Verstndnis/Mitgefhl haben, vor allem wenn wir uns dafr schon direkt entschuldigt haben und dir Tr sofort schlossen?\n\nZudem hielten Sie uns vor, dass wir die Vorhnge an den Fenstern geffnet haben (diese konnte man innerhalb von 3 Sekunden wieder schlieen, also keine komplizierte Konstruktion). Dies schien auch auf Nachfragen ein Grund zur cholerischen Aufregung zu sein. Sind Vorhnge nicht dazu da, geffnet zu werden?\n\n!!!Ich wnsche Ihnen alles Gute und hoffe, dass Sie NIE auf solche Menschen wie sich selbst treffen, wenn Sie in einer Notlage sind!!!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Jenny','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),(977,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung ist mit Liebe zum Detail und sehr zweckmig eingerichtet und bietet alles, was man fr eine kleine Auszeit bentigt. Geschfte, Restaurants und Ausflugziele befinden sich in unmittelbarer Nhe. Gerne wieder.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Martina','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),(978,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super Gastgeber! Tolle Wohnung, perfekt frs Wandern oder Skifahren!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Dennis','https://www.airbnb.de/rooms/31289582/reviews','Januar 2019'),(979,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Place is nice host is not',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Ellen','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),(980,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wonderful host, would definitely recommend.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Tyler','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),(981,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place, outstanding views and very clean',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Michael','https://www.airbnb.de/rooms/31289582/reviews','Juni 2020'),(982,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Marks place was a great base for our short stay in GP. The apartment was sparkling clean and had all that we needed for our stay. The only minor point for us was that the bath only had a handheld shower attachment, and we didn\'t realise this from the listing, however, this is our personal preference only and we appreciated it was probably due to the low ceiling heights. The apartment is located in a quiet residential area, with a 10/15-minute walk into the centre of GP, with free parking on the street outside which was a bonus for us.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Caroline','https://www.airbnb.de/rooms/31289582/reviews','September 2019'),(983,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Bel appartement , proprete irrprochable a 600 m des commerces de Partenkirchen .',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Franois','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),(984,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a lovely stay in Mark\'s place. It was sparkling clean, it had everthing that we needed and the bed was very comfortable. The view is absolutely amazing. Communication from him was quick and we were met by both him and his wife upon arrival. He also gave us some great local tips. We will definitely be back in future and can higly recommend his place.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Carlien','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),(985,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Marks place was in a great location. We were able to leave from the front door and go for hikes. The views from the balcony and windows were incredible. The kitchen was very small which was okay but it lacked a few items that wouldve been very helpful (there were no plates at all and only very big and very small bowls). The ceilings and doorways in the place are also very low which is hard to tell from the pictures. We had to crouch through some doorways and in the shower. Mark was prompt and professional with check in and check out. Overall, Marks place was a good fit for our time in GP!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Murray','https://www.airbnb.de/rooms/31289582/reviews','August 2019'),(986,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Mark has a great apartment. The town is lovely and the walk to the center and the train station and bus stops is not bad at all. About 10-15 minutes along the river! The best thing about the accommodation is the lovely view of the mountains from the balcony.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Gareth','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),(987,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A comfortable flat in a quiet area. All facilities although the kitchen is fairly basic. Lovely views of the mountains from the balcony. Mark is a brisk and efficient host. If you don\'t have a car it is a pleasant 15 mins walk to the station and a further 10 to Garmisch town centre. Flat is ideally placed for Partnach gorge (20 mins away.) No wifi in the flat. All in all a very pleasant stay.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'A','https://www.airbnb.de/rooms/31289582/reviews','Juli 2019'),(988,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment has great views of the mountains and the ski jump. Handy to bus service or a 10-15 minute walk to town. The kitchen is quite basic with 2 burners and a kettle. No microwave or toaster. Only 2xsaucepans and 1 small fry pan. We cooked a couple of very basic meals. It is probably not an issue if you eat out each night. We enjoyed our stay.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Noela','https://www.airbnb.de/rooms/31289582/reviews','Juni 2019'),(989,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great location for hiking the Zugspitze, lovely apartment!',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Cybele','https://www.airbnb.de/rooms/31289582/reviews','Juni 2019'),(990,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a nice stay. The apartment was great and had a very nice view. Was also very cozy and had everything we needed.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'Soha','https://www.airbnb.de/rooms/31289582/reviews','Juni 2019'),(991,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','My wife and I thoroughly enjoyed our stay at Marks apartment in Garmisch. We found it to be clean, quiet, and comfortable. It is located on a side street, with adequate parking and a pleasant walking path nearby. Garmisch is a beautiful town, and we enjoyed wandering around the downtown area visiting cafs, shops, and bckereis. We also enjoyed looking at the beautiful scenery. This is definitely on our list of visit again places.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'William','https://www.airbnb.de/rooms/31289582/reviews','Mai 2019'),(992,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice and clean apartment with easy access to the downtown. The accommodation provided us everything we needed. We enjoyed also bus passes that host provided. I recommend to be on time on check-in, otherwise you will get a \"nice\" welcome. I was late 13 min and the host was little bit unpleasant.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'ubica','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),(993,0,27,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Marks apartment is lovely and very well located halfway between Garmisch and the Olympic Ski jump. It is an excellent start point if you would like to explore Partnachklamm, which I would heartily recommend. It is about a 20 minute walk from the train station. The apartment was very clean and comfy and we loved our stay.',4.34,NULL,0,0,'2021-04-10 14:02:13','2021-04-10 14:02:13',0,1,NULL,'James','https://www.airbnb.de/rooms/31289582/reviews','Februar 2019'),(1071,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war einfach super! Man hat dort eine wunderschne Aussicht! Die Gegend ist wunderschn und man kommt zu allem schnell hin! Die Kommunikation und die Abwicklung waren freundlich, schnell und reibungslos! Gerne wieder!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Anuschka','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2020'),(1072,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Wohnung und super Lage! Wir haben uns sehr wohl gefhlt.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Christopher','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2020'),(1073,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Unterkunft, tolle Lage, tolle Vermieter!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Andre','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2020'),(1074,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Unterkunft, die ihren Teil zu unserem entspannten Urlaub beigetragen hat. Wir hatten die ersten beiden Tage ein bisschen Pech mit dem Wetter, was aber aufgrund der schnen Wohnung mit dem wunderschnen Alpenpanorama nicht weiter schlimm war. Die online gestellten Fotos bilden die Wohnung authentisch ab. Peter war als Gastgeber zwar nicht vor Ort, hat aber umgehend auf Mails und Anfragen reagiert und war jederzeit offen, superfreundlich und hilfsbereit. In dem Haus selbst wohnt zudem eine weitere Kontaktperson, die bestimmt auch jederzeit geholfen htte, wenn wir was bentigt htten. Die stdtische Baustelle vor dem Haus, die sich dort gerade befindet, war auch nicht wirklich strend. Von daher bleibt mir nur zu sagen: Wer im Gebiet Garmisch-Partenkirchen seinen Urlaub verbringen mchte, dem kann ich Peter und seine Wohnung nur wrmstens empfehlen. Danke!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jung-Hun','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2020'),(1075,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle Unterkunft und Ort, herrliches Panorama vom Balkon aus. Zugspitze, Eibsee und Hllental sind in unmittelbarer Nhe erreichbar! Gerne wieder!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jascha','https://www.airbnb.de/rooms/19774742/reviews','September 2020'),(1076,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Gerumige Wohnung mit schnen Bdern und tollem Ausblick in die Berge. Alles vorhanden was man braucht. Der Check-in und Check-ourt mit der Schlsselbox hat super geklappt. Der Holzboden knarzt, was nachts vor allem die Personen stren kann, die im oberen Bereich schlafen. Die Gstekarten waren leider nicht vorbereitet, wir htten sie aber in der Touristen-Info ausdrucken lassen knnen. Die Kommunikation mit Peter hat gut und schnell funktioniert.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Kerstin','https://www.airbnb.de/rooms/19774742/reviews','September 2020'),(1077,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schne Unterkunft in Obergrainau. Unkomplizierte, nette Vermietung.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Lukas','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1078,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung ist wirklich super schn und fr grere Gruppen geeignet (allerdings sollte man sich bewusst sein, dass einige Schlafpltze offen sind, steht aber auch so in der Beschreibung). Die Bder waren beide sehr schn und sauber. Auch sonst war alles sauber auer einige Teller. Schne Aussicht von den Balkonen. Die Bauarbeiten haben uns nicht gestrt, nur die nahestehende Kirche hat uns schon frh geweckt. Wir wrden wieder kommen!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jana','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1079,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Das grozgige Raumgefhl und der Balkon als Logenplatz, um den Dorfplatz zu beobachten, haben uns besonders gefallen. Die Angaben und Fotos entsprechen der Wohnung, so wie wir sie vorgefunden haben. Schne Randlage im Oberdorf in einer quirligen und stark besuchten Ferienregion. Sehr empfehlenswert!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Petra','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1080,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war sooo schn! Peter & Annika waren tolle Gastgeber! Die Kommunikation lief einwandfrei und sie waren sehr entgegen kommend. Die Wohnung sieht in echt noch viel schner aus, sie war blitzsauber und es war einfach herrlich mit diesen Ausblick in den Tag zu starten. Wirklich sehr zu empfehlen! Vielen Dank nochmal & bis hoffentlich bald mal wieder :)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Gabi','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1081,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Klasse Unterkunft. Es war, wie es beschrieben wurde; nichts geschnt oder ausgelassen. Einfach eine tolle Wohnung zum Wohlfhlen. Die Lage ist klasse, mit Blick auf die Bergwelt, kurze fulufige Wege zum Bcker (brigens ein echter Super-Bcker), zu Restaurants, Metzger, kleiner Supermarkt und zur Bahnstation der Zugspitzbahn. In alle Richtungen ist man sofort auf den gut ausgeschilderten Wanderwegen. Und wenn man doch mal mit dem Auto fhrt, ist am Haus immer ein Parkplatz. Die Wohnung selbst ist voll ausgestattet, Geschirr und Besteck ist mehr als ausreichend und aus einem Wurf (keine gesammelten Generationen-Nachlsse), gemtliche Betten und Sofas. Im Vorfeld war die Kommunikation zu Peter schon schnell, sauber, przise, und das hat sich fortgesetzt. Fr die wenigen offenen Fragen, die vor Ort waren, kam immer prompt und klar eine Antwort und Hilfe. Kurzum: das war nicht unser letztes Mal dort :-)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Thomas','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1082,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Wohnung war super gerumig fr uns vier, zwei Erwachsene und 2 Kinder. Ausstattung war super. Betten waren auch gut, der Blick herausragend. Die Dielen knarzen wirklich ordentlich, es sollte kein Frhaufsteher in der Gruppe sein, sonst sind alle wach ;-) wir kommen wieder. Uns hat es sehr gut gefallen, trotz Dauerregen. Tipp: mit der Kurkarte kostenlos ins Wellenbad in Garmisch.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Bianca','https://www.airbnb.de/rooms/19774742/reviews','August 2020'),(1083,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Unterkunft liegt sehr zentral. Eine Bushaltestelle ist in der Nhe, somit viele Ziele ohne Auto erreichbar. Mehrere Wandertouren starten in unmittelbaren Nhe. Es ist sehr gepflegte, saubere Unterkunft. Alles was man braucht ist vorhanden. Das Check-in unkompliziert und schnell. Auf