uni 2020'),(1093,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','tolle Wohnung in Superlage (nher an den Bergen geht es nicht) ! alles bestens',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Heinrich','https://www.airbnb.de/rooms/19774742/reviews','Juni 2020'),(1094,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir waren zu acht in Peters Wohnung. Darunter zwei Kinder (13 und 18 Monate), die in der Wohnung gut zurecht kamen. Es waren ein Kinderbett und ein Kinderstuhl bereits vorhanden. Die Wohnung wrden wir \"kindersicher\" beschreiben, wenn man das Sofa vor die Treppe stellt. Der Ort bot fr Spaziergnge gute Ausgangsmglichkeiten und die Skigebiete drumherum sind fr Familien perfekt. Auch die Kommunikation mit Peter hat hervorragend funktioniert, und vor Ort war auch noch jemand, den man notfalls um Hilfe bitten konnte. Ich kann diese Unterkunft nur wrmstens empfehlen.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Sebastian','https://www.airbnb.de/rooms/19774742/reviews','Februar 2020'),(1095,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Unterkunft blieb nicht hinter den Erwartungen zurck. bergaberegellungen erfolgten unkompliziert ber das Airbnb-Portal / (Hidden by Airbnb) . Telefonkontakt war nicht erforderlich. Die Wohnung ist sehr schn. Kaffeevollautomat und Kaminofen funktionierten ohne Probleme. TV- und Audiountersttzung entspricht nicht dem brigen Standard.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Reinhard','https://www.airbnb.de/rooms/19774742/reviews','Januar 2020'),(1096,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Das Apartment war sehr gut, die Kommunikationwar super und es ist sehr empfehlenswert.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Felix','https://www.airbnb.de/rooms/19774742/reviews','Dezember 2019'),(1097,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir hatten eine Wundervollen Aufenthalt in dieser auergewhnl