 14:13:42',0,1,NULL,'Brigitte','https://www.airbnb.de/rooms/19774742/reviews','Juni 2019'),(1103,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Unterkunft ist super schn und hat eine tolle Lage direkt an der Zugspitze. Die Kommunikation war schnell und klasse!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Lucienne','https://www.airbnb.de/rooms/19774742/reviews','Juni 2019'),(1104,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super schne Wohnung inmitten der Berge und toller Natur. Peter ist beraus hilfsbereit und zuverlssig. Absolute Weiterempfehlung.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Verena','https://www.airbnb.de/rooms/19774742/reviews','Juni 2019'),(1105,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Eine super schne Wohnung und eine perfekte Lage! Wir kommen gerne wieder.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Meriem','https://www.airbnb.de/rooms/19774742/reviews','Juni 2019'),(1106,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wunderbar! Es bleiben keine Wnsche offen - bis ins Detail. Rundum sorglos, rundum glcklich.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Caroline','https://www.airbnb.de/rooms/19774742/reviews','Mai 2019'),(1107,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Unterkunft war wunderbar fr 7 Personen, ich glaube 2 Weitere htten auch noch Platz gehabt. Die Galerie und die Balkone tragen zu einem fantastischen Raumgefhl bei und die Gemtlichkeit wird durch den Kamin abgerundet. Da wir von schlechtem Wetter berrascht wurden war eine schne Unterkunft umso wichtiger. Wir kommen wieder ;)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Dana','https://www.airbnb.de/rooms/19774742/reviews','Mai 2019'),(1108,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Traumhafte Wohnung in toller Umgebung. Entspricht absolut der Beschreibung. Einfach alles vorhanden, alles blitzsauber und n