nikation mit Peter war beispiellos Gut! Sowas ist selten bei AirBnb. Absolut empfehlenswert! Wir kommen irgendwann mal wieder :)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Michael','https://www.airbnb.de/rooms/19774742/reviews','Mrz 2019'),(1113,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir haben Peters Wohnung mit drei Erwachsenen und zwei Kindern bewohnt und haben uns sehr wohl gefhlt. Wir hatten ausreichend Platz und haben die gemtliche Atmosphre sehr genossen. Die zwei Badezimmer sind sehr schn gestaltet. Der 180 Grad Blick in die Berge ist der pure Genuss und die Ausstattung der Kche (inkl. Kaffeevollautomat) bietet alles, was man braucht. Peter und Annika haben super schnell reagiert als wir mal in Not waren und auch sonst haben sie uns mit smtlichen Tipps und Informationen ausgestattet. Ich kann diese Wohnung wirklich weiterempfehlen!!!!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Katja','https://www.airbnb.de/rooms/19774742/reviews','Februar 2019'),(1114,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super schne Wohnung, tolles kleines rtchen ganz nah bei Garmisch, blitzsauber, super ausgestattet -sogar Bohnen fr die Kaffeemaschine... uns hat es an gar nichts gefehlt... haben uns super wohl gefhlt! Peter antwortet super schnell und beantwortet alle Fragen! Hatten ein tolles Wochenende',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Stefanie','https://www.airbnb.de/rooms/19774742/reviews','Januar 2019'),(1115,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schne Wohnung mit optimaler Lage zur Zahnradbahn, dem Ort und als Startpunkt zu schnen Winterwanderungen in der Umgebung. Sehr wohnliche Atmosphre durch den Ofen und das Holz des Bodens und der Decke. Beschreibung und Bilder stimmen gut mit den Gegebenheiten berein. Wir kommen gerne wieder.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Martin','https://www.airbnb.de/rooms/19774742/review