'Geheimtipp',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Stefan','https://www.airbnb.de/rooms/19774742/reviews','Juli 2018'),(1127,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Unterkunft ist einfach perfekt. Tolle Umgebung und perfekter Ausgangspunkt fr Ausflge, Wanderungen etc. Prima Ausstattung - es ist einfach alles vorhanden was man braucht und fhlt sich rundum wohl. Die Kommunikation mit Peter lief auch reibungslos.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Lisa','https://www.airbnb.de/rooms/19774742/reviews','Juni 2018'),(1128,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schne Lage. Wohnung sehr schn. Auch in der Kche ist alles vorhanden. Wir haben uns sehr wohlgefhlt.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Michael','https://www.airbnb.de/rooms/19774742/reviews','April 2018'),(1129,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schne Wohnung, die super eingerichtet ist. Die Gastgeber sind sehr nett und hilfsbereit!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Fabian','https://www.airbnb.de/rooms/19774742/reviews','Mrz 2018'),(1130,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Eigentlich widerstrebt es mir, fr diese Unterkunft eine Bewertung zu schreiben: Es soll doch ein Geheimtipp bleiben!! Was soll ich sagen: Es war genial! Fr die Menge der Personen (wir waren 7) ist der Platz mehr als ausreichend. Uns hat vor allem gefallen, dass wir super am Tisch sitzen konnten ohne uns stndig im Weg zu stehen. Groer Khlschrank, super Kaffeevollautomat und genug Geschirr. Die Bilder entsprechen der Tatsache: wunderschn und mit viel Geschmack eingerichtet. Der Kontakt zu Peter war toll und sehr spontan und witzig :-) Wir kommen wieder. Herzliche Gre nach Grainau',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Viola','https://www.airbnb.de/rooms/19774742/reviews','Februar 2018'),(1131,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war wirklich toll bei euch... Wir haben uns sehr wohl gefhlt. Die Ausstattung der Wohnung war super und der Stil hat sehr unseren Geschmack getroffen. Wir konnten auch ohne Auto alles erreichen ... die Lage ist perfekt. Und die Kinder fanden die Gallerie super zum spielen und toben ;) wir berlegen direkt im Sommer wiederzukommen :)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Julia','https://www.airbnb.de/rooms/19774742/reviews','Februar 2018'),(1132,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wunderschne Unterkunft, super ausgestattet und Gastgeber bei Fragen sehr offen. Gerne wieder!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Gregor','https://www.airbnb.de/rooms/19774742/reviews','Februar 2018'),(1133,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Ferienwohnung am oberen Dorfplatz in Grainau ist ein wahres Juwel! Nicht nur die Lage ist optimal (kurzer Weg zur Zahnradbahn, Bcker und Lebensmitteleinzelhandel sowie viele Restaurant gleich um die Ecke, Eibseenhe etc.), sondern auch die Wohnung selbst lsst einen vom ersten Augenblick an den Urlaub genieen. Die Bilder halten absolut das, was sie versprechen: Sauberkeit, eine liebevolle Einrichtungsweise, Gemtlichkeit, Grozgigkeit. Die Kommunikation vorab und auch whrend unseres Aufenthaltes war jederzeit einwandfrei. So konnten wir Peter problemlos kontaktieren, um zu fragen, ob man den Kachelofen anschren darf oder um eine neue Glhbirne zu erhalten. Spitze!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Theresa','https://www.airbnb.de/rooms/19774742/reviews','Januar 2018'),(1134,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr gastfreundlich, tolle Location, immer sehr schnelle Antworten im Vorfeld und im Nachhinein - jederzeit gerne wieder!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Ben','https://www.airbnb.de/rooms/19774742/reviews','Dezember 2017'),(1135,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wahnsinnig schne Unterkunft mit einem traumhaften Panoramablick. Die Kommunikation mit Peter war tadellos, genauso wie der Check-In. Vielen Dank!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Fabian','https://www.airbnb.de/rooms/19774742/reviews','Dezember 2017'),(1136,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle, grozgige Wohnung mit ausreichend Platz, modern und gleichzeitig gemtlich, mit sehr guter Ausstattung und sensationellem Blick ber den Ort und in die Berge. Perfekter Ausgangspunkt fr Ausflge. Nette Kommunikation mit den Gastgebern.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Silke','https://www.airbnb.de/rooms/19774742/reviews','November 2017'),(1137,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war ein rundum gelungener Aufenthalt. Die Unterkunft war sehr schn. Alles super sauber und sehr gut ausgestattet. Die Lage der Unterkunft war perfekt. Alles schnell zu erreichen, ausreichend Restaurants fulufig und auch die Wanderwege konnte man locker ohne Auto starten. Wir werden bestimmt wieder kommen. Vielen Dank fr alles.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Claudia','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2017'),(1138,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir waren sehr begeistert von der Schnheit Wohnung und kommen gerne wieder. Alles perfekt: Lage, Ausstattung, Sauberkeit, Kommunikation mit dem Vermieter....Vielen Dank!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Franca','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2017'),(1139,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Das Air BnB war der Hammer! Die Wohnung ist wunderschn! Altbayrischer Fler gemischt mit einer modernen und frisch renovierten Ausstattung. Die Wanderwege gingen direkt vor der Haustr los und auch in Richtung Dorf war alles schnell erreicht. Die Kommunikation mit den Hosts verlief einwandfrei wenn nicht sogar perfekt. Gerne wieder! Empfehlung!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Lennard','https://www.airbnb.de/rooms/19774742/reviews','September 2017'),(1140,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schne und ruhige Wohnung. Peter hat sogar extra fr uns den Kamin angeschlossen, so dass wir ihn anheizen konnten. Es gibt nichts, aber auch nichts auszusetzen !',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Ingo','https://www.airbnb.de/rooms/19774742/reviews','September 2017'),(1141,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peter und seine Schwester waren tolle Gastgeber, immer ansprechbar wenn bentigt ohne jedoch aufdringlich zu sein. Die Wohnung ist toll eingerichtet und neu renoviert. Insgesamt absolut empfehlenswert!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Patrick','https://www.airbnb.de/rooms/19774742/reviews','September 2017'),(1142,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir hatten die Unterkunft fr einen kurzen Familientrip gebucht (zu dritt) und die Bleibe war einfach nur genial. Peter hatte uns vorab ber unsere Bedrfnisse befragt (ua Kinderbett) und alles vorbereitet. Die Kommunikation im Vorfeld war super und absolut hilfreich. In der Wohnung dann: Alles super neu und modern eingerichtet. Dazwischen wurden ein paar originale Holzbacken verbaut. Echt toll und gemtlich. Zustzlich gibt es zwei Balkone mit genialer Aussicht auf dem man auch speisen kann. (Kaffee gibt es brigens inklusive!!). In unmittelbarer Nhe gibt es tolle lokale Restaurants, Bcker und nen kleinen Lebensmittelladen fr den tglichen Bedarf. Wren gerne lnger geblieben aber wir kommen definitiv zurck-auch weil Peter (plus Familie) einfach tolle Gastgeber sind.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Oliver','https://www.airbnb.de/rooms/19774742/reviews','August 2017'),(1143,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die neue, voll ausgestattete und liebevoll renovierte Wohnung ist mindestens genau so schn wie auf den Fotos zu sehen. Bei passendem Wetter hat man die Wahl zwischen drei verschiedenen Balkonen, die Wohnung ist aber auch sehr gut geeignet fr einen lngeren Aufenthalt bei schlechtem Wetter. Die Lage knnte besser nicht sein, direkt am Berg und gleichzeitig fusslufig zu Restaurants und Bcker. Peter ist ein groartiger Gastgeber. Wir wurden sehr herzlich empfangen, Fragen wurden immer umgehend beantwortet. Unseren nchsten Aufenthalt in Grainau werden wir sehr gerne wieder bei Peter verbringen.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Birgit','https://www.airbnb.de/rooms/19774742/reviews','Juli 2017'),(1144,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schne Dachwohnung und Peter ist ein sympathischer Gastgeber, der sich viel Mhe gibt, seinen Gsten alles Recht zu machen. Alles prima.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Andreas','https://www.airbnb.de/rooms/19774742/reviews','Juli 2017'),(1145,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Unser Urlaub bei Peter in Grainau war einfach super! Die Wohnung hat unsere Erwartungen vollstndig erfllt, die Kommunikation mit Peter ist superschnell und unkompliziert. Auch hat uns der Ort sehr gut gefallen und das Skigebiet und die Zugspitze sind zweifelsohne eine Reise wert. Wir knnen die Unterkunft wrmstens weiterempfehlen!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Ruth','https://www.airbnb.de/rooms/19774742/reviews','Februar 2020'),(1146,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schne Wohnung mit drei Balkonen mit Ausblick auf den Dorfplatz und zur Zugspitze. Einfaches Check-in mit Schlsselsave und Gstekarten ... Hat uns sehr gut gefallen :) Danke',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Stefan','https://www.airbnb.de/rooms/19774742/reviews','Mai 2018'),(1147,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The Appartment matches completely our expectations, very nice atmosphere, clean and well Decorated. The location is perfect, in middle of nice village, all commodities are (very) close by, everything went smooth and good with Peter. I would recommend to big family. Special Big-up to the multi-sight from the appartment of the mountains and the Zugpitze.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Zineb Et Cyprien','https://www.airbnb.de/rooms/19774742/reviews','Mrz 2020'),(1148,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful and comfortable apartment for our family get together. We loved how close we were to the mountains, the comfortable sitting spaces and the friendly and helpful hosts.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Juliana','https://www.airbnb.de/rooms/19774742/reviews','September 2019'),(1149,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The location is perfect! We have been to the area a lot and just discovered the little gem of Grainau! Peters place is beautiful and easily fit our group of 5 adults and 3 kids. Plenty of restaurants within a very short walking distance. A yummy cheese shop close by. The apartment had easy check in, front door parking and plenty of space. Peter was quick to respond to any question I had and suggested a few things I did not even think to ask about. We had an amazing time in the village and in all the surrounding areas we visited. I would definitely stay here again!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Wendy','https://www.airbnb.de/rooms/19774742/reviews','Juli 2019'),(1150,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place in a beautiful location. Perfect to explore the Zugspitzarea and Garmisch!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Sebastian','https://www.airbnb.de/rooms/19774742/reviews','Mai 2019'),(1151,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Impeccable flat in a beautiful location. Slept like a baby.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Christine','https://www.airbnb.de/rooms/19774742/reviews','April 2019'),(1152,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wonderful host, quick response and detailed check-in/out instructions. Nice location and lovely town. Apartment was clean, spacious for my family of 6 members. Will surely book with them in case we visit again. Thanks for making our stay a wonderful one. Appreciate it !',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Saravanan','https://www.airbnb.de/rooms/19774742/reviews','April 2019'),(1153,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing cozy penthouse in a really nice place, direct to Zugspitze and Eibsee. It is 100% appealing for gruops',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Pilar','https://www.airbnb.de/rooms/19774742/reviews','November 2018'),(1154,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','What a truly magical place! This home has it all! Majestic views, stylishly decorated, fantastic location and outstanding hospitality. Our family has great memories of Bavaria and this home was part of it.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Frances','https://www.airbnb.de/rooms/19774742/reviews','September 2018'),(1155,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','I highly recommend Peter\'s flat. He is a great host and his flat was very clean. The communication with Peter was quick and welcoming. If you\'re on your way to Grainau then I\'d recommend staying at Peter\'s flat.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Tobias','https://www.airbnb.de/rooms/19774742/reviews','April 2018'),(1156,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place is fantastic!! The pictures are great but the place is even cuter and more cozy in person! We were a group of 6 adults and 2 dogs and the space was just the right size! Everything was so clean and the beds were comfortable. The location is great, right in the heart of Grainau in walking distance from several restaurants but still having beautiful Mountain Views from the balconies. The cable car to Zugspitz is less than 10 minutes by car. Peter was an exceptional host! He was very quick to respond to all of my questions with very thorough, thought out answers and excellent suggestions. Everyone was very happy with our stay and we will definitely recommend this place to our friends!!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Monica','https://www.airbnb.de/rooms/19774742/reviews','Mrz 2018'),(1157,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great apt.. easy to find, and great views',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Ryan','https://www.airbnb.de/rooms/19774742/reviews','Dezember 2017'),(1158,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Absolutely amazing apartment and location. Highly recommended!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Donnachad','https://www.airbnb.de/rooms/19774742/reviews','August 2017'),(1159,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It is a wonderful place. First: location, location, location, at the top of the village, many walks accessible without needing a car, an absolutely stunning view onto Germany\'s highest mountain, the Zugspitze. The flat has windows in three directions (and terraces in two), one bedroom faces due East and lets an amazing amount of light in, the sitting room and its terrace let you watch the sun go down, magical. It provides lots of space for two couples, and would accommodate another 4 to 5 kids (or young people who do not need a lot of privacy as the other beds are on a gallery open to the main sitting/eating/kitchen space). We did not miss any equipment. What my husband and I enjoyed particularly was sitting in the hammocks on the gallery in the evening letting our souls and feet relax gently overlooking the flat. A perfect mountain retreat.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Katharina','https://www.airbnb.de/rooms/19774742/reviews','September 2020'),(1160,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peter\'s apartment is centrally located. It was very spacious and clean. There are balconies with really nice views of the mountains. If you are in the Garmisch region, I would definately recommend you to stay in the space.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Abhishek','https://www.airbnb.de/rooms/19774742/reviews','Juli 2020'),(1161,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This spot is in an ideal location. You are right at the foot of the mountains and only moments from trails that will take you to all the sights including the Zugspitze, Eibsee, and Hoellentalklamm (which was closed due to washout in June 2020). The views are fantastic from the apartment and there are three patios to enjoy. The sounds of the livestock grazing in the fields was a highlight as they all wear bells. That added to the charm of the location. There are also restaurants within walking distance and one that is just down the street and with very good food. This place would be perfect for a large family as it has two private rooms downstairs and an open loft that sleeps around five people upstairs.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Rick','https://www.airbnb.de/rooms/19774742/reviews','Juni 2020'),(1162,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peters apartment was perfect for a holiday on the slopes. A great space that was brilliantly stocked.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Amelia','https://www.airbnb.de/rooms/19774742/reviews','Mrz 2020'),(1163,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Absolutely perfect place to spend time in Bavaria. Grainau is close to many attractions, has walking trails available right from the apartment and is so beautiful. The apartment is spacious, clean and so comfortable. There is a fireplace for cosy evenings after a day exploring. There are great restaurants within walking distance as well as a delicious bakery. We had a wonderful family reunion. Peter is quick to respond to questions and offers good suggestions for what to do and where to eat.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Lisa','https://www.airbnb.de/rooms/19774742/reviews','Mrz 2020'),(1164,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Het is een mooi gebied, locatie heeft potentie, echter is de inventaris aan vervanging toe.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Anja','https://www.airbnb.de/rooms/19774742/reviews','Februar 2020'),(1165,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peters place was bright and clean and comfortable. It was well situated for our ski tripjust a short drive to Lermoos and the Zugspitze. We even drove to St. Anton on one day (about 90 min away). There was plenty of space for our group: 4 adults and 3 kids.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jessica','https://www.airbnb.de/rooms/19774742/reviews','Januar 2020'),(1166,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',',, ,,,,,, ,eibsee',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'','https://www.airbnb.de/rooms/19774742/reviews','Dezember 2019'),(1167,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Stay in this beautiful, clean, comfortable apartment if you have the opportunity! We enjoyed a hyggeligt holiday there in early December. The location is fantastic, with easy drives to Garmisch, Eibsee, the cog train or cable car up the Zeugspitze, Oberammergau, Ettal, and a day trip to Neuschwanstein. The Alpine views from the apartment are breath-taking. We visited in the off season and most of the restaurants in Grainau were closed, however Garmisch was a 10 minute drive and many places were open there. The host is very responsive and gracious. Check in was simple. Our 9 year old and 13 year old children loved sleeping in the loft and relaxing in the hammock chairs. The bathrooms were spacious and clean. We did not cook while there, but the kitchen was well-equipped. We enjoyed pastries from the bakery just across the square in the mornings before setting out on our adventure for the day. We also enjoyed a short hike up the foot of the Zeugspitze right behind the house with a lovely view of the town.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Alison','https://www.airbnb.de/rooms/19774742/reviews','Dezember 2019'),(1168,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Home was very conveniently located in village, close to train, restaurants and mountains. Home very nicely done and great views of the surrounding mountains.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Lori','https://www.airbnb.de/rooms/19774742/reviews','November 2019'),(1169,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','I enjoyed the apartment very much and it was very nice and the place was great and quiet I would recommend it very strongly, and the host answers the questions quickly & very helpful',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Mohammed','https://www.airbnb.de/rooms/19774742/reviews','November 2019'),(1170,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peters place was clean and so cute! Great place for a large family. I would recommend this place to anyone.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Leslie','https://www.airbnb.de/rooms/19774742/reviews','November 2019'),(1171,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great location, cute apartment, very spacious.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Kevin','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2019'),(1172,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',',,,,,,,,,',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Haiyan','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2019'),(1173,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','My family and I had the extreme pleasure of staying in Peters 3rd floor apartment. Once you arrive and take in all the rustic Bavarian charm and beauty of his home with sweeping views all around from each balcony of the Alps, you will know you have reached the most breathtaking spot on earth. It was very hard to leave this place as it felt as an instant home made with much love and thoughtful touches throughout. Every balcony faces a magnificent view. Spacious apartment with an upper loft, wooden beams and rooftop skylights, Bavarian charm and decor, along with Peters warm hospitality made this a dream vacation. If you have the pleasure of visiting Grainau, look no further! Peters Oberen Dorfplatz location will welcome you to an alpine home that will make lasting memories.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Maria','https://www.airbnb.de/rooms/19774742/reviews','September 2019'),(1174,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place is incredible. Stayed here for 3 days because the costs in Munich were so high. Everything about it was amazing. You walk out your door and youre immediately on hiking trails. It was stunningly gorgeous and I highly suggest you book this place if you can',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Dominic','https://www.airbnb.de/rooms/19774742/reviews','September 2019'),(1175,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The Top Floor Apartment has everything you need for a long stay in the Garmisch Partenkirchen area. The amenities are great and the place is comfortable and affordable. Peter is a good communicator and there is on site help available if needed to answer questions.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Arnold','https://www.airbnb.de/rooms/19774742/reviews','September 2019'),(1176,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A one-of-a-kind home with spectacular views in a story book village. The home was spotless and comfortably furnished, there were balconies facing every direction with perfect views of Grainau and the mountains and every thing we needed to compliment our stay within a moments walk. The communication with Peter was easy and his response to our questions was quick and clear. We can\'t say enough to express how much we enjoyed our stay.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Kevin','https://www.airbnb.de/rooms/19774742/reviews','September 2019'),(1177,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','      ',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Abdullah','https://www.airbnb.de/rooms/19774742/reviews','August 2019'),(1178,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This apartment is located in a quaint village with nice amenities. The apartment has great views and is near beautiful hiking trails.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Traci','https://www.airbnb.de/rooms/19774742/reviews','August 2019'),(1179,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peters place in Grainau is excellent in every way. It is right next to the trails to the Zugspitze, near dozens of restaurants, and a very short walk to the train station. A small grocery store is a short walk away, and there a large supermarkets a short drive away. Peters house is spotlessly clean, very comfortable, and well suited to groups. I would highly recommend staying here.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'John','https://www.airbnb.de/rooms/19774742/reviews','Juli 2019'),(1180,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was a lovely apartment with beautiful views of the mountains on all sides. The location is great for exploring the local area - restaurants, the train station and the local pool are all in easy walking distance. Peter was quick with communication and helpful. The only downside was the significant construction work happening on the square directly outside the building. This caused a lot of early noise, affected the electricity supply one morning, and made comings and goings and parking rather more complicated. Hopefully this will be over soon for others!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Kristin','https://www.airbnb.de/rooms/19774742/reviews','Juli 2019'),(1181,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We absolutely loved the apartment as well as the town of Grainau. The apartment was clean and comfortable, and it was located close to restaurants and hiking. It was definitely one of the highlights of our German vacation!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Mary','https://www.airbnb.de/rooms/19774742/reviews','Juli 2019'),(1182,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peters home was a lovely place to stay to visit the quaint town of Grainau. It was very conveniently located for day hikes to Eibsee and Hollentalklamm Gorge. There were several good restaurants within a short walking distance. The kids in our group enjoyed the loft space and hammocks.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Johanna','https://www.airbnb.de/rooms/19774742/reviews','Juli 2019'),(1183,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful apartment and good location',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Sulaiman','https://www.airbnb.de/rooms/19774742/reviews','Juli 2019'),(1184,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Simply stunning apartment in an amazing location!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Traci','https://www.airbnb.de/rooms/19774742/reviews','Juni 2019'),(1185,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peter\'splace is an absolutely lovely apartment in a stunning location. We enjoyed our stay very much and hated to leave. It is perfectly clean and charmingly decorated. Stay here!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Vicki','https://www.airbnb.de/rooms/19774742/reviews','Juni 2019'),(1186,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peter was easy to communicate with. We ran into some trouble finding the place due to construction and he was able to help us get to the house. Any other questions or concerns we had were easy because he was quick to respond and helpful with all concerns.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Harald','https://www.airbnb.de/rooms/19774742/reviews','Juni 2019'),(1187,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful home. Amazing location. Our family of seven stayed very comfortably here at the foot of the mountains. We wish we could have stayed longer!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Kristina','https://www.airbnb.de/rooms/19774742/reviews','Juni 2019'),(1188,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment was very clean and the views were incredible! Peter was very responsive to questions and check-in and out was seamless. Definitely recommend this place, especially if you are planning to visit the Zugspitze.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'David','https://www.airbnb.de/rooms/19774742/reviews','Juni 2019'),(1189,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This Condo was great. Very well equipped, modern appliances, and plenty of room to spread out. It is also walking distance from almost everything you could want or need and only a short drive to everything else. Overall, this place and its surrounding area is like walking into a fairytale. We would definitely come back.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'The Bee','https://www.airbnb.de/rooms/19774742/reviews','Juni 2019'),(1190,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice place and great location , very clean place and excellent host',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Moayad','https://www.airbnb.de/rooms/19774742/reviews','Juni 2019'),(1191,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Strongly recommend to a small group of traveller, even without driving the bus stop and train station is just few steps away. Nice apartment with beautiful view',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Tay','https://www.airbnb.de/rooms/19774742/reviews','Mai 2019'),(1192,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We loved the apartment and the kids really enjoyed the loft with hammocks. There was some construction in front of the building while we were there and you do have to walk up 2 flights of stairs. There are multiple nice restaurants in walking distance. Very scenic views.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Rie','https://www.airbnb.de/rooms/19774742/reviews','Mai 2019'),(1193,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A beautiful space inside and out! Peters place was gorgeous and clean. The beds were comfortable and the amenities were all we needed. There is a stunning view out of every window and from the two beautiful balconies. The location is perfect with restaurants, trails and the train within easy walking distance. I hope to make it back to this place someday.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Danielle','https://www.airbnb.de/rooms/19774742/reviews','Mai 2019'),(1194,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The place has wonderful views, has updated plumbing and appliances in a still rustic house. The town is quiet and charming, we would love to come to back during the ski season.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'William','https://www.airbnb.de/rooms/19774742/reviews','Mai 2019'),(1195,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This is a really great place and exceeds expectations. A fantastic location, a delightfully cosy place and an extremely helpful host. What more can you ask for!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Luisa','https://www.airbnb.de/rooms/19774742/reviews','April 2019'),(1196,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment is very beautiful. The host is very nice.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Bridget','https://www.airbnb.de/rooms/19774742/reviews','April 2019'),(1197,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If you\'re considering staying in this house, do it - you will not regret it! Great location, extremely clean, modern finishes, and Peter was very responsive and helpful.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Mary','https://www.airbnb.de/rooms/19774742/reviews','April 2019'),(1198,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Een geweldig appartement met alle voorzieningen op een prima locatie in Grainau op loopafstand van het treinstation waar je de trein richting de Zugspitze of Garmisch Partenkirchen kunt nemen. Aanrader voor gezinnen met kinderen.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Walewijn','https://www.airbnb.de/rooms/19774742/reviews','Mrz 2019'),(1199,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfect location for a skiing holiday.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Eskild','https://www.airbnb.de/rooms/19774742/reviews','Februar 2019'),(1200,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The accommodation was very satisfactory,The kitchen is well equipped and convenient, and the beds are clean and comfortable. Thanks to the homeowner, I\'ll go back to Europe and choose this place.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2018'),(1201,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We loved staying at the chalet. Simple yet clean. Great views from the house and we especially loved the fireplace and the cozy atmosphere. There are some quaint restaurants near by in walking distance. Grainau is a quiet and charming village. I wish we could have stayed longer to hike and mountain bike as the trails look extensive and stunning.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Amy','https://www.airbnb.de/rooms/19774742/reviews','September 2018'),(1202,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','I can\'t convey the beauty of the surrounding views from the balconies at Peter\'s place. Surreal  may be the best word. This alone would be a reason to stay.\nHowever, Peter\'s place was also fantastic. It is spacious, clean, comfortable, and very close to everything you need. We enjoyed playing cards one evening at the large dining table. We also made a fire one evening when the weather changed. There are several bakeries in town with one being only about 50 meters from the house. The ATM is close (many places throughout Germany only accept cash), and multiple good restaurants.\nWe also visited Lake Eibsee,  the Partnach gorge, and Zugspitze by cable car. Each can\'t be missed. \nAs is well stated by Peter and other reviewers, this is on the top floor without an elevator. We had no problem with the stairs, but especially with luggage, this could be a problem for someone with mobility issues.\nLooking back, if we had extra days to spend on this trip, we would have chosen more in Grainau at Peter\'s place.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Charlotte','https://www.airbnb.de/rooms/19774742/reviews','September 2018'),(1203,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If AirBnB offered a six star rating, this place deserves it! The views from the apartment are stunning and the pictures don\'t do it justice. The space is impeccable, spacious, and very cozy. I couldn\'t have wished for more! Peter was a great host and made everything very easy for my group. I highly recommend a stay in Grainau!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Adrienne','https://www.airbnb.de/rooms/19774742/reviews','September 2018'),(1204,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Thank you peter we are very thankful fo every thing ,so happy i am choosing such as great and fantastic place like yours Thank you',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Samar','https://www.airbnb.de/rooms/19774742/reviews','Juli 2018'),(1205,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Grainau is a place highly recommend to travel in Germany. If you plan to stay at Grainau, you need to choose Peter\'s house! The location and view is excellent here! The facilities are functionable and good, and spacious for us (4 people). The fireplace is fantastic for us as the temperature drops to about 12 degree with heavy rain during our stay. If I go to Grainau again, I will choose Peter\'s house=)',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Irene','https://www.airbnb.de/rooms/19774742/reviews','Juni 2018'),(1206,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','GP, GrainauGrainau3-5,!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'','https://www.airbnb.de/rooms/19774742/reviews','April 2018'),(1207,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The view from Peters place was absolutely gorgeous. Right at the foot of the Alps. The place was new, modern and very clean. Comfy beds, and info on things to do in the area. We couldve used instructions on the coffee maker. The town was charming and there were several restaurants within steps from the place. Not a lot of cooking utensils/pots etc. Very enjoyable stay overall.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Anne','https://www.airbnb.de/rooms/19774742/reviews','Mrz 2018'),(1208,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Everything is perfect.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Li','https://www.airbnb.de/rooms/19774742/reviews','Februar 2018'),(1209,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We stayed for almost three weeks, and got to enjoy this special place. It is well positioned for the keen skier and for those who\'d like to get away from the big city (and have a truly genuine alp village experience). Peter was a great host, and made sure we were welcomed and had the information we needed. Annika was always at hand in the house as well.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Mikael','https://www.airbnb.de/rooms/19774742/reviews','Januar 2018'),(1210,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This apartment is everything and much more. The setting is straight out of a fairytale offering spectular views from every window. We spent Christmas here and did a lot of our own cooking. Everything was easy and great! Coffee machine is wonderful! Communication with Peter was excellent and swift. He was extremely helpful with tips and recommendations. We are a family of five and had plenty of room to stretch out and just relax in this comfy updated apartment.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Michelle','https://www.airbnb.de/rooms/19774742/reviews','Dezember 2017'),(1211,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The excellent house and beautiful village!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jaeho','https://www.airbnb.de/rooms/19774742/reviews','Oktober 2017'),(1212,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wow, for a family of 6 adults, one child and one infant, I couldn\'t have asked for more. The instructions provided by the host for checkin, his quick responses on airbnb, and his local guidance was amazing. Will definitely take the place next time if i go there. 5 stars on the rating',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Nilesh','https://www.airbnb.de/rooms/19774742/reviews','September 2017'),(1213,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Peter\'s place was fantastic! Absolutely gorgeous views abound and we spent so much time relaxing on the balconies soaking in the amazing scenery. We had a car, but the town was very walkable and everything we needed was nearby. Everyone in our group agreed that if we could change anything it would have been to stay at Peter\'s place and in Grainau longer. I would recommend or return to this awesome place for a future trip!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Heidi','https://www.airbnb.de/rooms/19774742/reviews','September 2017'),(1214,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374',',,,,,,,,',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Maggie','https://www.airbnb.de/rooms/19774742/reviews','September 2017'),(1215,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was a fabulous stay at a quaint location in Grainau. The place was beautiful and clean. Peter always responded quickly and check in was smooth. Hope to stay here again one day!',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jessica','https://www.airbnb.de/rooms/19774742/reviews','September 2017'),(1216,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Our stay at Peter\'s place and our interactions with Peter were absolutely excellent. Communications with Peter were quick, accurate, and to the point, yet very personal. He was very responsive. As one example - in response to my concerns about potential warm weather, Peter went out and purchased fans! - which in the end proved unnecessary. We met Peter and his family, while we were there, and they were gracious and charming. The  the alpine house and our apartment were wonderful, and my wife and I and our 4 grand children loved it, particularly its adjacent proximity to the mountains and  amenities. There is also adjacent dedicated parking.  The town is beautiful and charmingly small with great restaurants, and it is quickly accessible to Garmisch, Eibsee, and the Zugpitze (Germany\'s tallest mountain complete with cog rail train and cable car access) along with easy and quick access to two well stocked food markets very close by. We walked to the local bakery almost every morning, which is less than a block down the street. The kids climbed the mountains, went swimming at the top-notch and very walk-able town community center, and were regulars at the local mini-golf course, which is also right down the street. It was a wonderful \"old world\" experience, complete with cows with their bells grazing on on the mountain and the traditional ringing church bell from the onion spire of the town church. I am not ordinarily a person who would give such a strong endorsement, but this was an experience that was truly outstanding. I have only one caveat - if you have any problem with mobility, particularly stairs, the apartment is two flights up, so, I would carefully consider this, otherwise, enjoy.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Jackson','https://www.airbnb.de/rooms/19774742/reviews','August 2017'),(1217,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Every things were amazing and Peter was a great host , many thanks for a beautiful welcoming and was very helpful.',4.93,NULL,0,0,'2021-04-10 14:13:42','2021-04-10 14:13:42',0,1,NULL,'Mohammad','https://www.airbnb.de/rooms/19774742/reviews','August 2017'),(1218,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Alles perfekt',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Inge','https://www.airbnb.de/rooms/36505219/reviews','September 2020'),(1219,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Der Aufenthalt bei Julya hat uns sehr gefallen. Die Wohnung war super sauber, es war alles vorhanden was man braucht und man hat einen direkten Blicj auf die Zugspitze. Alles was man fr den tglichen Bedarf braucht war in ubmittelbarer Reichweite. Julya war auch sehr nett und flexibel. Gerne wieder :)',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Monika','https://www.airbnb.de/rooms/36505219/reviews','August 2020'),(1220,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super schne, saubere und gemtliche Ferienwohnung. Lage ist perfekt. Ebenso wie die super freundliche und hilfsbereite Gastgeberin. Wir kommen gerne wieder.',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Lisa','https://www.airbnb.de/rooms/36505219/reviews','August 2020'),(1221,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Julya ist eine groartige Gastgeberin. Sie hat uns sehr herzlich empfangen und uns mit jeder Menge Tips fr unseren Aufenthalt versorgt. Das Appartement ist bestens gelegen. Es sind nur wenige Gehminuten zum Zentrum und zu verschiedenen Einkaufsmglichkeiten. Trotzdem ist es sehr ruhig, da das Appartement von der Strae aus etwas zurckgesetzt liegt. Die Kche ist sehr gut ausgestattet und das Wohnzimmer gemtlich. Fr unseren Junior war sogar ein Babybett da; das ersparte es uns ein Reisebett mitzunehmen. Wir wrden jederzeit wieder buchen.',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Stefan','https://www.airbnb.de/rooms/36505219/reviews','August 2020'),(1222,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Julyas Apartment befindet sich mitten in Ehrwald, zum Metzger/Bcker und diversen Lden und Cafs /Restaurants sind es nur wenige Schritte. Begrt und verabschiedet wurden wir herzlich und persnlich. Die Zeiten konnten wir unkompliziert absprechen. Die Wohnung hat eine toll ausgestattete Kche mit gemtlicher Eckbank und ein neu renoviertes Bad mit Fussbodenheizung. Insgesamt gibt es in der Wohnung auch genug Auslauf, damit auch an Schlechtwettertagen kein Lagerkoller ausbricht.',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Simon','https://www.airbnb.de/rooms/36505219/reviews','Mrz 2020'),(1223,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Julya ist eine super nette Gastgeberin, freundlich, unkompliziert und hilfsbereit -auch bei special requests! Alles war super sauber und in der Kche komplett ausgestattet! War alles perfekt! Danke! :)',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Anna','https://www.airbnb.de/rooms/36505219/reviews','August 2019'),(1224,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','tolles 3 zi App, sauber ,liebevoll eingerichtet . Alles da wie zuhause . besonders schn der Kaminofen mit allem was man zum HEIZEN braucht!!',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Helmut','https://www.airbnb.de/rooms/36505219/reviews','August 2019'),(1225,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ich war positiv berrascht , wie gro und schn diese liebevoll eingerichtete Ferienwohnung ist . Es war alles vorhanden und wir waren wunschlos glcklich. Der Kamin hat mir besonders gefallen. Die Gastgeberin ist sehr nett und gastfreundlich . Ich mchte gerne erneut kommen. Die Wanderwege sind rasch zu erreichen. Ehrwald ist traumhaft schn .',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Ariane','https://www.airbnb.de/rooms/36505219/reviews','August 2019'),(1226,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice place, very short walk to the restaurants.',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Ruben','https://www.airbnb.de/rooms/36505219/reviews','August 2020'),(1227,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The appartment was near the center of Ehrwald on a quiet location. The appartment is spacious and has a new bathroom. The kitchen was really well equiped with everything we need to make a good diner. The appartment was also very clean. Julya was very flexible in making an appointment for the welcome and was very friendly. So everything was perfect for our overnight stay in Ehrwald.',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Tom','https://www.airbnb.de/rooms/36505219/reviews','Juli 2020'),(1228,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very nice and spacious apartment. Wonderful new bathroom. We enjoyed ourselves very much. The kitchen was fully equipped. When we arrived the owner decorated the house with a Christmas tree. The owner is very friendly and helpful. A perfect place for families with 2 or 3 children on a central location in Ehrwald.',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Joyce','https://www.airbnb.de/rooms/36505219/reviews','Dezember 2019'),(1229,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Julia, thanks so much for your flexibility. Our stay was fantastic, we appreciate that your appartment was so sper clean. We wish you the best in Airbnb.',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Ruben','https://www.airbnb.de/rooms/36505219/reviews','August 2019'),(1230,0,11,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Julya was were kind. The apartment is near the village center, on a quiet location, has everything you need. There are great places nearby to visit. Thanks.',4.85,NULL,0,0,'2021-04-10 16:27:09','2021-04-10 16:27:09',0,1,NULL,'Gyrgy','https://www.airbnb.de/rooms/36505219/reviews','August 2019'),(1243,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Alles gut, besonders die Kommunikation mit den Vermietern.',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Samuel','https://www.airbnb.de/rooms/20719380/reviews','Oktober 2019'),(1244,0,9,'00001','66bb87a0-b5dc-11ea-ae50-