ub Kurhaus - ca. 15min zu Fu - und dann ber Murnau problemlos nach Garmisch. Sehr nette Wohnung mit Schlafzimmer, Balkon, Wohnzimmer (mit Schrankbetten) mit Sofa und Esstisch. alles bestens, kann man empfehlen ! Gru',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Lukas','https://www.airbnb.de/rooms/20719380/reviews','Januar 2018'),(1251,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','All was good, thank you.',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Natalia','https://www.airbnb.de/rooms/20719380/reviews','Februar 2020'),(1252,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This apartment is perfect for 2-4 people looking for a place to stay near the alps. Garmisch, Neuschwanstein, Oberammergau and Lindau are all easy to reach with the car. Cute apartment, great amenities , excellent communication and very clean place! Restaurants and the Hrnle Bahn are close by (walking distance) and the neighborhood is nice and quiet. We would love to stay here again. Many thanks franziska!',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Alexandra','https://www.airbnb.de/rooms/20719380/reviews','Juni 2018'),(1253,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place was exactly what we needed. It was spacious, close to dining and a running trail, and gave us good access to the Neuschwanstein and Hohenschwangau castles. We would absolutely recommend this place and would stay at this airbnb again in the future.',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Ryan','https://www.airbnb.de/rooms/20719380/reviews','Oktober 2019'),(1254,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The communications wasnt good because few hours before chick in I text her regarding to the check in process and she said that there is a problem at the apartment and i will give you another one better & near to it But unfortunately it was small only one king bed and a sofa bed The host there ...Holland and his family are so nice but my point is that the apartment wasnt like what i reserve and its smaller Good for couples only',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Mazin','https://www.airbnb.de/rooms/20719380/reviews','September 2019'),(1255,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The place is too small for 6 people, they\'re only 4 really bed (including 2 retractable in the living room), but the localisation is nice !',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Cecile','https://www.airbnb.de/rooms/20719380/reviews','August 2019'),(1256,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Clean and tidy. Kids friendly.',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Chewin','https://www.airbnb.de/rooms/20719380/reviews','Mai 2019'),(1257,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','El alojamiento es cmodo y est muy bien comunicado para visitar los diferentes lugares de inters de la zona: Linderhof, Neuchswantein, Mittenwald, Oberammergau,... El entorno es muy bonito.',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Cristina','https://www.airbnb.de/rooms/20719380/reviews','April 2019'),(1258,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a dream holiday, everything from location to comfort recommending this place as the perfect winter getaway in Bavaria. Access to ski and sledge slopes is in front of your balcony. You are at minutes distance of any major point of interest or winter resort from the area. The apartment is perfect for a family of 4, perfectly arranged with all you can think of in terms of furniture and appliances. The kids loved it and we felt like home. One thing that we found difficult at the beginning was access to a supermarket or restaurant, but as we accommodate with the town and the area, we realized everything was at a few minutes away of driving. Yes, you need a car to fully benefit of this place. We are already thinking at our next winter holiday to spend it here also.',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Florin','https://www.airbnb.de/rooms/20719380/reviews','Februar 2019'),(1259,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wonderful location, great host with great communication. Centrally located for quick trips to Munich about an hour and a half away, and 30 mins to Garmisch. Franiska was wonderful at making sure we had a great stay.',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Megan','https://www.airbnb.de/rooms/20719380/reviews','Januar 2019'),(1260,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Good communication with Host.. Clean apartment. Very Nice!',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Rafi','https://www.airbnb.de/rooms/20719380/reviews','September 2018'),(1261,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Lappartement de Franziska est trs bien situ et est un bon point de dpart pour diverses balades. Lappartement est bien quip et le balcon est trs agrable pour se reposer aprs une escapade dans les environs. Je recommande cet appartement  qui veut visiter cette rgion et  qui aime les promenades en montagne',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Jean-Christophe','https://www.airbnb.de/rooms/20719380/reviews','August 2018'),(1262,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very cozy but rather small flat. Beautiful surroundings an lovely little village. Close to castle Neuschwanstein and other sights.',4.71,NULL,0,0,'2021-04-10 16:35:36','2021-04-10 16:35:36',0,1,NULL,'Karoline','https://www.airbnb.de/rooms/20719380/reviews','Juli 2018'),(1263,0,9,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It was a quite and lovely place located in a picturesque town, right next time chair lift. However its recommended if you have your own car. Check in was smooth. There are couple of good restaurants in the downtown, we particularly loved 