4,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Tatiana','https://www.airbnb.de/rooms/22523800/reviews','August 2020'),(1559,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Dita and her family are amazing hosts, who really go above and beyond to make your stay very enjoyable! With a fast response, great tips and good conversations we had a great time! The space is super clean and very homey!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Jutta','https://www.airbnb.de/rooms/22523800/reviews','September 2019'),(1560,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Last minute booking and Dita was very accommodating. The apartment is well stocked and we slept 4 comfortably (fit in couch folds down the size of about a king size bed). I would stay here again. Great little town and close to Garmish for skiing. Only complaints: The shower head is awesome, unfortunately at 6\'4\" it came to just below my shoulder. But great water pressure and plenty of hot water. The parking was across the street in the grocery store parking lot. Both issues were minor and should not deter most people from staying here.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Joe And Cristin','https://www.airbnb.de/rooms/22523800/reviews','Januar 2019'),(1561,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ditas place was so nice. Lots of vintage art that made my star even more interesting. I love how chic yet efficient her place is. Walking distance to the alpine coaster and city center. And, its a perfect starting point for runners or cyclist. I totally recommend her place.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Nia','https://www.airbnb.de/rooms/22523800/reviews','September 2018'),(1562,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great Location, wonderful hosts, and clean rooms! Dita was quick to respond to my messages, recommended an amazing local restaurant, and her dog is so sweet! Highly recommend her BnB!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Danielle','https://www.airbnb.de/rooms/22523800/reviews','Juni 2018'),(1563,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Abbiamo soggiornato 4 giorni presso l appartamento di Dita. L appartamento  in mansarda e la propreitaria vive nell appartamento al piano si sotto. Siamo stati trattati con cortesia dalla priprietaria. La posizione  ottima per qualsiasi escursione. Ampio parcheggio sempre libero proprio di fronte alla casa e sempre di fronte alla casa ci sono diversi supermarket. Mi sento di consigliarlo',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Monaldo','https://www.airbnb.de/rooms/22523800/reviews','August 2020'),(1564,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sjour trs agrable chez Dita. Belle maison et trs joli appartement dcor (Art Nouveau) avec beaucoup de got, il y a tout ce qu\'il faut, trs propre. Bonne communication avec Dita pour notre arrive. Bon emplacement. Beaucoup de choses  faire dans la rgion. Nous recommandons absolument.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Benoit Et Lucie','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1565,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sweet apartment and outstanding location. Had a good time. The apartment is in the attic so low ceilings on the corners caused a few bumped heads. But the bed and couble sofa bed are very comfortable for 4 adults.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Chitra Mohan','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1566,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Comfortable and clean, near the center of the town, several supermarkets just across the road.Very nice and caring host Dita',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Maxim','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1567,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This is a wonderful place for travelers to stay during a trip to lovely Oberammergau. Dita is extremely courteous and helpful, offering us suggestions for hikes and other fun things to do while in town (try the Alpine Coaster!). The space itself is especially charming and cleanwe felt comfortable there at once. There is one bedroom with (I think) a Queen size bed, and a pull out sofa bed thats about the same size in the main room that also houses a sink, small stovetop, and fridge. The bathroom and shower room are very clean, and towels were provided. The shower is a bit low in height (Im 61 and had to crouch a bit to fit under the shower head) but this is honestly a minor inconvenience unless you are especially tall (I think anyone 58 or under can fit in it without issue). The location is primea 1min wall from the bus stop, several grocery stores and shops are right across the street, perhaps 5 or so min from the town center with restaurants and shops, and walkable to many trailheads. Truly I can not recommend this lodging (and Oberammergau) enough!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Harrison','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1568,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Trs commodment place entre Garmisch-Partenkirchen d\'un ct et le chteau de Neuschwanstein de l\'autre,  proximit du palais de Linderhof, la trs belle maison de Dita offre de beaux espaces au deuxime tage. L\'quipement est suffisant et la dcoration est sublime.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Philippe-Aurle','https://www.airbnb.de/rooms/22523800/reviews','August 2019'),(1569,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Its not too large but very nice apartment in a one of the most beautiful old stylish villas in the town. Decorated with a great taste with art nouveau details and in whole dedicated to Mucha. It is a very calm surroundings so we slept very good. Liddl is just in front of the house, and all the historical famous buildings are just in five minutes. The town itself is very small so almost everything would be a centre)) but a special advantage was an rail alpine coaster that starts almost just behind the house (again, thank you, Dita, for the great advice!). Also its just 1 hour walking from the beautiful cloister of Ettal that definitely in the must see list. Dita is a wonderful host, hostile and attentive. Highly recommended!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Olga','https://www.airbnb.de/rooms/22523800/reviews','Juli 2019'),(1570,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A wonderful stay! Dita is very responsive and her place is very nice!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Dale','https://www.airbnb.de/rooms/22523800/reviews','Juli 2019'),(1571,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Really nice flat! Dita was a really nice host and gave uss good tips what to do!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Satu','https://www.airbnb.de/rooms/22523800/reviews','Juli 2019'),(1572,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This is a great place at a perfect location with a friendly host. Defenitely recommend it to anyone!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Katrin','https://www.airbnb.de/rooms/22523800/reviews','Juli 2019'),(1573,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place in a beautiful town. Lovely hosts...',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Chad','https://www.airbnb.de/rooms/22523800/reviews','Juni 2019'),(1574,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Stylish apartment in an early 20th century villa.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Karlis','https://www.airbnb.de/rooms/22523800/reviews','April 2019'),(1575,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It was a pleasure to stay here, convenient, many shops nearby, very close to the city centre, extremally clean, overall high quality, in reality it looks better than on a pictures.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Aleksy','https://www.airbnb.de/rooms/22523800/reviews','Januar 2019'),(1576,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great space in an historic house in Oberammergau. Dita was very helpful with suggestions, and even Christmas decorations (we were there for Christmas).',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Jim','https://www.airbnb.de/rooms/22523800/reviews','Dezember 2018'),(1577,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ottima accoglienza, ottima anche la location.. Grazie',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Ledjon','https://www.airbnb.de/rooms/22523800/reviews','Oktober 2018'),(1578,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was the best Airbnb Ive stayed in. The apartment was even nicer than pictures and had a cozy feel. What really sold it was Ditas hospitality. She lives on site and seeing we had two young daughters she had her children share some toys and books in English, which our girls loved playing with and reading. Dita gave us great tips on what to see and do and simply couldnt have been a better host. The location was also fantastic. Across the street from grocery stores, one with a great cafe and excellent bread, and walking distance to everything in town. There is a great path along the river, which looked nice for a bike ride. The highlight was the alpine slide, which is the longest in Europe, and is basically right behind her house. We had a car and found her house to be a great jumping off point for many area highlights, including 3 of Ludwigs castles Do not hesitate to book here!',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Nick','https://www.airbnb.de/rooms/22523800/reviews','Oktober 2018'),(1579,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A very lovely family! Great tips on the town, great outdoor adventures to be had! Perfect central location, would definitely stay there again',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Tracye','https://www.airbnb.de/rooms/22523800/reviews','August 2018'),(1580,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','At Ditas house is every little thing beautiful and stylish. Very clean and comfortable. The location is super, beautiful views around. Opposite the house are supermarkets, nice walk to the center takes about 10 min.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Andres','https://www.airbnb.de/rooms/22523800/reviews','Juli 2018'),(1581,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','dita was such a great hidt hrlping us with any questions we have. the olace was extremely lovely as well',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Ryan','https://www.airbnb.de/rooms/22523800/reviews','Juli 2018'),(1582,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a wonderful stay in Oberammergau and the it is the perfect location for everything you want to do in the surroundings. We got many good advice for hiking, although we had it all planned in advance, were greeted very friendly and if i ever come back I would never hesitate to check out the availability of Ditas place again!! Feel free to be amazed :)',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Sofie','https://www.airbnb.de/rooms/22523800/reviews','Juli 2018'),(1583,0,28,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Comfortable apartment in the attic, clean and functional, nice housemaid Dita. Markets near but peacefull. beds maybe a little too hard but sometimes it`s good.',4.94,NULL,0,0,'2021-04-14 04:50:45','2021-04-14 04:50:45',0,1,NULL,'Satu','https://www.airbnb.de/rooms/22523800/reviews','Juli 201