1379053/reviews','February 2021'),(1716,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sparkling clean and dreamy spot. We hope to come again sometime.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Sadie','https://www.airbnb.com/rooms/21379053/reviews','February 2021'),(1717,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Outstanding place to stay. Spotless clean and very welcoming. Would definitely stay again.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Patrick','https://www.airbnb.com/rooms/21379053/reviews','October 2020'),(1718,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place, great location (right on the river). Cb\'s place is spacious with high ceilings, immaculately clean, modern, and equipped with all the amenities you need. I hiked along the river, and at night I took a flashlight and watched two otters swimming and fishing. The river with its adjacent is beautiful - out of a movie. I set my folding chair alongside and ate lunch while I stared at the fall foliage and listened to the crows and moving water. Check in was as easy as it gets.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Paul','https://www.airbnb.com/rooms/21379053/reviews','September 2020'),(1719,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Cb\'s place was nice.right off the main 4 wheeler trail and nice and quiet. Would stay again',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Jordan','https://www.airbnb.com/rooms/21379053/reviews','September 2020'),(1720,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This is a beautiful property with excellent hospitality. Serene and relaxing. If you are looking to relax and just enjoy the beauty of country and nature, this is your place.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Tracy','https://www.airbnb.com/rooms/21379053/reviews','September 2020'),(1721,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sparkling clean, great hosts, and a beautiful apartment. We can\'t wait to come back!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Amy','https://www.airbnb.com/rooms/21379053/reviews','August 2020'),(1722,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If you are looking for a place to experience Northern Maine\'s summer beauty or the Northern Wood\'s winter wonderland, Cb hosts a perfect place to stay. At the end of a winding private drive, the apartment has it\'s own entrance and it was immaculate when we arrived. Cb, was gracious enough to work with us on our arrival time and was very welcoming. While there are other rentals(camps) on the property, each is set away from the others and each is private and quiet. The back drop to the location is the picturesque Aroostook River, with one of the main ATV/sled trails that follows the banks of the river able to be accessed from the property. The wilderness is just a few steps down from the camps. One morning we awoke to the sound of a hunting eagle over the river. The interior of the apartment showcases custom wood work, private bed rooms (one in a perfect loft), and an open theme that allows you to move you travel gear in easily. The bathroom is spacious with amenities on the shelves such as towels, wash clothes & mats. The kitchen area is perfect for preparing anything you could want to make yourself and is well stocked with plates, bowls and cooking ware. Alternatively, the apartment is also only 10 to 15 minutes from the \"major\" towns in the area should you want to eat out. The wifi allowed all three of us to connect multiple devices with no issues and we did not experience any type of latency. I will be recommending Cb\'s places to anyone looking to stay in Northern Maine. We had an excellent time there and it was perfect for our annual guys weekend!! Thanks Cb!\nShow more',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Noah','https://www.airbnb.com/rooms/21379053/reviews','August 2020'),(1723,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a lovely trip to quaint Caribou, Maine. The apartment was spacious and open and we had a private entrance which made it feel like our own. The views of the river and the peace of the area were lovely. Would book again!',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Jessica','https://www.airbnb.com/rooms/21379053/reviews','August 2020'),(1724,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Spacious place with astounding woodwork. The location is wonderful if you want a true rural existence. The river trail was just down the slope and provided amazing wildlife sightings for the patient and persistent - moose, deer, beaver and more eagles than you can shake a stick at! Dark skies as well in case you feel like stargazing. This is the closest I have felt to living in the wild in a long time. Amazing.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'James','https://www.airbnb.com/rooms/21379053/reviews','August 2020'),(1725,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place. Very clean. Out of the way but not too far from stores/shops. Woukd stay here again.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Karen','https://www.airbnb.com/rooms/21379053/reviews','July 2020'),(1726,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','My stay was warm, welcome, and I could not ask for a better host. This particular cabin has such a serene setting on the river. I enjoyed my stay and look forward to coming back.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Anthony','https://www.airbnb.com/rooms/21379053/reviews','June 2020'),(1727,0,1,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','I booked this for my son and his friends to go snowmobiling. It was a great, clean place.',4.97,NULL,0,0,'2021-05-28 14:57:00','2021-05-28 14:57:00',0,1,NULL,'Tonya','https://www.airbnb.com/rooms/21379053/re