trs e supermercado.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Bruno','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1910,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Lovely little loft in a lovely suburb of Munich ! Bus stop is just a couple of minutes walk from the loft and will take you about 25 minutes to get to the city centre. Overall, for a short stay, my girlfriend and I had great time in Caroline and Tobias\'s loft.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Thomas','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1911,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice place in Munich, good for a quiet stay away from the busy city !',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Terence','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1912,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place to stay in Munich ! Quiet and nice neighborhood! Caroline was very kind and response very quick ! Check in and check out wasnt a problem ! Great and very cozy place inside ! We really enjoyed staying at this place ! Recommend! Thank you !',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1913,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Caroline and Tobias were great hosts! The space was perfect for our short stay and first time to Germany! Everything was clean and comfortable and very convenient. We loved our first trip to Munich and having a great place to stay helped!',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'McKenna','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1914,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The room is not big but it has everything you need! Super clean and cozy. Caroline is super friendly. And we had a nice stay in their place! The transportation is also easy, 3 mins walk to bus stop.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Wenjun','https://www.airbnb.de/rooms/34928560/reviews','September 2019'),(1915,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This space was amazing and we appreciated it tremendously. It was very organized, clean, and functional while having many extra touches that made the place feel like home for a few days. They had very timely communication and much detail about the place and the area that we used on our visit. Just note that it is a little ways away from the airport, so plan the public transportation accordingly. Overall would highly recommend to anyone wanting to stay in Munich.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Kayla','https://www.airbnb.de/rooms/34928560/reviews','August 2019'),(1916,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wow, where do  even start? First, location is great - just a few minutes away from a subway station and literally steps away from a bus stop. Very safe and quiet neigbourhood. n terms of furnishment - we literally had everything that a prime hotel would offer and even more. n addition to that, Carolina and Tobias were very helpful and kind. Bonus: They have a lovely garden where you can drink tea forever. Definitely will stay there next time as well',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Narmina','https://www.airbnb.de/rooms/34928560/reviews','August 2019'),(1917,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The place is really nice, it is located in the garden of Caroline\'s house.\n\nThe flat is decorated very beautiful and has everything you could need: comfortable bed, TV with netflix, washing machine for clothes, kitchen with everything, etc..\n\nWe had an amazing stay with Caroline & Tobias, and both of them were really nice with us.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Julissa','https://www.airbnb.de/rooms/34928560/reviews','Juli 2019'),(1918,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Caroline and Tobias are phenomenal host. I stayed at there wonderful room for around a month and I loved it. Everything that you may possibly need for short or extended stays is offered. The communication is instant and they truly make sure that you are comfortable. Thank you guys for offering such a great spot!!! Also, the rooms is a bit colder than any of the rooms that Ive stayed at in Munich this summer. Thanks again guys!',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Phillip','https://www.airbnb.de/rooms/34928560/reviews','Juli 2019'),(1919,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great accommodation. We felt as at home. There is everything you need for home.',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'Zan (Jean)','https://www.airbnb.de/rooms/34928560/reviews','Juni 2019'),(1920,0,2,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','5',5,NULL,0,0,'2021-11-24 05:52:19','2021-11-24 05:52:19',0,1,NULL,'','https://www.airbnb.de/rooms/34928560/reviews','Juni 2019'),(1987,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful house all around in a country side setting. Large yard, fire pits, woods, and outdoor seating area are all very nice. The internet was about as expected of cable internet, fast enough downloads but fairly slow upload speeds.\n\nLike 5-10 minutes away from the little town with a few restaurants. ~1 hour away from a larger town. 30 minutes away from Canada.\n\nThe one dog is very lovely, the other takes some time to get used to you and is very energetic. There are apparently houses nearby that you can walk to see, but I did not get a chance to find them.',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Kevin','https://www.airbnb.com/rooms/46443466/reviews','September 2021'),(1988,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Staying at Jennifer\'s place was a real treat! The whole family is super friendly without being overbearing. Plenty of privacy in the thoughtfully appointed bedrooms if that\'s what\'s needed, and lovely chats over morning coffee as well.\nThe house is big and comfy and very clean. Being able to do laundry during my stay was quite helpful.\n\nJen and her family are quite knowledgeable about the area and have excellent advice on how to enjoy their little slice of heaven. If you\'re looking to get away from it all in a quiet town that somehow manages to have plenty to do, this is the place for you!!',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Christine','https://www.airbnb.com/rooms/46443466/reviews','September 2021'),(1989,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Jennifer and her husband were wonderful hosts! Their house and my sleeping space were more than I could have asked for, and their location is perfect for exploring the North Maine Woods. I hope to stay here again next summer.',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Robert','https://www.airbnb.com/rooms/46443466/reviews','July 2021'),(1990,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If you\'re in Northern Maine and need a place to stay, look no further. I was initially a little apprehensive to stay in an AirBnB with the homeowners, but I\'m so glad I chose to. Their house and property is absolutely beautiful. We enjoyed meals together, laughed together, and I learned a lot about the area.\n\nThey were so welcoming and friendly and it was perfect. Plus I made some new friends in the process.',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Stacee','https://www.airbnb.com/rooms/46443466/reviews','June 2021'),(1991,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Had a very nice stay with a nice family at a beautiful home',5,NULL,0,0,'2021-12-10 06:17:45','2021-12-10 06:17:45',0,1,NULL,'Kevin','https://www.airbnb.com/rooms/46443466/reviews','April 2021'),(1992,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce3