absolut top zum Wandern, da man alle Wanderwege und Talstationen der Alpspitz/Kreuzeckbahn zu Fu erreicht.\nWir haben uns in einer Woche Wanderurlaub sehr wohl gefhlt und knnen die Unterkunft nur empfehlen.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Gloria','https://www.airbnb.de/rooms/21411333/reviews','September 2019'),(2171,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sehr schne Unterkunft mit einer fantastischen Aussicht vom Balkon. Wanderwege fangen in unmittelbarer Laufnhe an.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Frederik','https://www.airbnb.de/rooms/21411333/reviews','Juli 2019'),(2172,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir haben hier zu viert vier schne Tage verbracht, es ist alles genau so wie beschrieben. Ich finde es zwei Personen Ideal.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Frank','https://www.airbnb.de/rooms/21411333/reviews','Mrz 2019'),(2173,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Tolle, gemtliche Unterkunft, welche perfekt fr einen kurzen Skiurlaub geeignet ist. Wir waren mit vier Erwachsenen dort und haben uns sehr wohl gefhlt.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Gina','https://www.airbnb.de/rooms/21411333/reviews','Februar 2019'),(2174,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','ein sehr idyllisch gelegenes, nettes und durchdacht eingerichtetes Appartment',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Angela','https://www.airbnb.de/rooms/21411333/reviews','Juni 2018'),(2175,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wir hatten einen super Aufenthalt in der zwar recht kleinen, aber gemtlichen und super angebundenen (5min. bis zur Zugspitzbahn) Wohnung! Die Kommunikation lief super. Vielen Dank fr die unverzglichen Rckmeldungen und Tipps!!',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Oliver','https://www.airbnb.de/rooms/21411333/reviews','Januar 2018'),(2176,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Schne Wohnung in super Lage mit schneller Anbindung an die Zahnradbahn und zu Einkaufsmglichkeiten.\nUns empfing der sehr freundliche und flexible Hausmeister fr die Schlsselbergabe. Die Wohnung war gemtlich mbliert und verfgt ber eine gute Ausstattung (Smart-TV,Radio,Kaffee,Tee,Salz/Pfeffer etc.).\nZu beachten ist,dass die Wohnung fr 4 Personen sehr knapp bemessen ist. Ebenso wie das Klopapier. Im Bad fehlte die Seife und in der Kche das Spli. Auerdem wre es von Vorteil gewesen sich vorab anhand eines Fotos ein Bild von der Kche (sehr kleine Zeile mit kleinem Waschbecken, mobile Herdplatte und winziger Backofen) machen zu knnen.\nBeim Ausklappen der Schlafcouch fanden wir unter dem Teppich eine nicht unerhebliche Menge Sand.\nDie zur Verfgung gestellten Hotel-Schlappen sollten gewaschen oder ersetzt werden.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Mara','https://www.airbnb.de/rooms/21411333/reviews','Februar 2022'),(2177,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very very clean flat, with comfortable bed and excellent shower, and a sofa bed in the living room that fits two children comfortably. There is a small kitchen with almost everything to do from a good breakfast or an easy lunch. And the highlight of this place, the pleasant living room with a stunning view to the Alpspitze and other mountains, really cool. Location is fantastic, close to a train station (3 min walking) in Grainau (the flat is very quiet), driving you reach the crowded Garmisch-Partenkirchen in 10 min and have access to supermarkets, restaurants and the ski lifts. Is a 4 season place I would say. Communication was good and clear. Thank you Romy !',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Ernesto','https://www.airbnb.de/rooms/21411333/reviews','Februar 2020'),(2178,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Good place for ones who want to ski in the area. Close to local train, which is 1 station to the ski area. Perfect for couples',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Andrei','https://www.airbnb.de/rooms/21411333/reviews','Februar 2020'),(2179,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment is suitable for 2 adults, can accommodate another 2 if the living room is equipped with a curtain (currently only half of the window is shedded with a curtain)',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Enyayaya','https://www.airbnb.de/rooms/21411333/reviews','Juni 2019'),(2180,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Staying in Romys flat was like living in a fairytale...for a long weekend, anyway. The apartment is situated in Hammersbach, near Grainau, a perfectly small hamlet away from the craziness of G-P. It is quiet, peaceful, and bucolic. Beautiful walking trails are minutes from the door and the balcony delivers a stunning view of the Waxensteins. A little bit further away are the trails to Hllentalklamm and other trails that lead to Zugspitze. In fact, this flat is on the way to Zugspitze and Eibsee, so locationally, I thought it was perfect (you are also not far from the Bayerische Zugspitzbahn stop which takes you everywhere in the area). The flat itself was super cozy and perfectly equipped. While we are two smallish females, I could see where a tall person would feel claustrophobic due to the slant ceilings, but it worked for us. We wanted for nothing and this is the first AirBnB Ive stayed in where I wouldnt change a thing. Romy was very responsive and gave us tips on what to do in the area. I hope we can come back again!',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Cecilia','https://www.airbnb.de/rooms/21411333/reviews','April 2019'),(2181,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We spent a hugely enjoyable 5 nights at Rommy\'s flat. Rather than stay in urban Garmisch, this place gives you a stupendous view of Zugspitze and Alpspitze. You are right underneath them and the lush surrounding forest. Listen for the sound of the stream when sitting on the balcony.\n\nIf you don\'t have a car like ourselves, you\'ll have to get your supplies from elsewhere as there isn\'t a supermarket you can pop out to (as far as I know). Shops down road in Grainau or next to Garmisch rail.\n\nAll in all, super place to stay.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Vik','https://www.airbnb.de/rooms/21411333/reviews','August 2019'),(2182,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','?',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Metib','https://www.airbnb.de/rooms/21411333/reviews','August 2019'),(2183,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment place is amazing and nearby train, bus and haiking mountain.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Mohammad','https://www.airbnb.de/rooms/21411333/reviews','August 2019'),(2184,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment is wonderful, the sofa bed was the most comfortable one we\'ve encountered. The location is perfect if you like hiking or cycling, and the main grocery stores are closer than they are to town. Great location.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Gustav','https://www.airbnb.de/rooms/21411333/reviews','Juli 2019'),(2185,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Romy provides a very cute and cozy apartment. The view from the balcony in the mornings is breathtaking. The ONLY very minor complaint was that the room the bed is in has a pitched ceiling so its a bit difficult to get in/out the bed or be in the room at all for anything other than sleeping. Other than that our stay was very enjoyable and Romy was a very sweet host.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Ali','https://www.airbnb.de/rooms/21411333/reviews','Juli 2019'),(2186,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A beautiful, cozy apartment. Very comfortable for two or three people. The balcony has a superb view of the Zugspitze and the apartment contains everything you would need for a short or long stay. The communication was perfect and the host was very helpful. The apartment is in an amazing location for visiting the mountains and lakes with the train and bus just a couple of minutes walk away. We couldnt have asked for a better place to stay and very highly recommend the apartment.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Ian','https://www.airbnb.de/rooms/21411333/reviews','Juli 2019'),(2187,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great ambiance, lovely balcony with a great view on Zugspitze mountain.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Cees','https://www.airbnb.de/rooms/21411333/reviews','Mrz 2019'),(2188,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice and tidy apartment with a great view over the mountains. More suitable for 2-3 people than 4 people. Great host that is replying on time and is willing to discuss any problem.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Petr','https://www.airbnb.de/rooms/21411333/reviews','Januar 2019'),(2189,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice place with a view to Zugspitze! Perfect if you are for a hiking holiday!',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Anton','https://www.airbnb.de/rooms/21411333/reviews','Januar 2019'),(2190,0,25,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Romy\'s home is very nice, the communication worked very well and the location is great if you are into skiing or hiking with the closest lifts just a 15-minute stroll away and train to other lifts even closer than that.\nThe flat has two drawbacks though, which makes me think the value is not fantastic. First, the heavily sloping walls can make life quite uncomfortable - I was literally unable to stand up in any part of the bedroom and bending over to cross the room is not necessarily what you want when your body aches from yesterday\'s skiing. Second, we experienced significant rain in the mountains (for which I am not going to blame Romy) and found no appropriate place to dry the wet skiing jackets and pants. If you bring your own skis and boots, space constraints are going to be even more of an issue.',4.38,NULL,0,0,'2022-05-09 04:23:22','2022-05-09 04:23:22',0,1,NULL,'Niels','https://www.airbnb.de/rooms/21411333/reviews','Januar 2018'),(2423,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','What to say... This is art in architecture:) Was a pleasure to spend a night in this (bird)box for people!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Matej','https://www.airbnb.ca/rooms/34692739/reviews','May 2022'),(2424,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Staying in this birdbox, in front of this stunning view makes you feel really calm and blessed for being there. It is an once in a lifetime experience sleeping and waking up deeply in the wild nature of Norway. Torstein had been a perfect host responding almost immediately to our messages. He even found a way to satisfy our desire to have a shower during our stay there. I wish that all hosts were like him.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Nikos','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2425,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Clearly you book this place for the views and unique accommodation! Sunset was the best, and we didnt realize there was a little campsite next to the Birdbox where you can use the firewood and grill dinner if you purchased groceries in town. The bathroom area is in the barn nearby, which is also where we kept our belongings since the Birdbox only has a few feet space outside of the bed. Be sure to bring only what you need in a backpack, as the Birdbox is 200 meters away from the parking area and can be steep if youre trying to bring up any luggage. Bed was very comfortable with plenty of pillows and blankets, and heating was nice. Would recommend to anyone who also loved to dronewe took some amazing photography and video footage!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Laura','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2426,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Incredible stay, the views are even better in real life!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Matt','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2427,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Torstein\'s #birdbox is beautifully situated and offers a great view of the fjord. There is even a fireplace on the small veranda, which further enhances the whole experience. The interior is extremely comfortable and cosy.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Mario','https://www.airbnb.ca/rooms/34692739/reviews','March 2022'),(2428,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fairytale place! We really loved the location and the view, a fantastic place for a staycation away from home. Even though it was raining most of the time we still lit a bonfire in between the rainfall. It was magical. Torstein responded quickly to any request, gave clear instructions and sorted out a problem we had in a smooth manner. Some minor stuff in the Birdbox should be repaired for an even better impression - but the view and the calm of the place is wonderful and trumps it all. Recommend!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Linda','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2429,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It was like sleeping in a gallery with an ever changing masterpiece of landscape painting.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Bjrn','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2430,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfekt get-away ?',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Caroline Christine','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2431,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A pleasant stay, even though it was raining heavily, the view was amazing. Definintely recommend!! ?',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Aurelija','https://www.airbnb.ca/rooms/34692739/reviews','October 2021'),(2432,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','What a stunning place! The view and the sunset was incredible.\nI loved being up in the hills and just listening to the cow bells in the valley.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Chloe','https://www.airbnb.ca/rooms/34692739/reviews','August 2021'),(2433,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','10/10',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Helene Hheim','https://www.airbnb.ca/rooms/34692739/reviews','August 2021'),(2434,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Stunning view, highlight of our roadtrip.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Dorian','https://www.airbnb.ca/rooms/34692739/reviews','August 2021'),(2435,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Was really amazing and special\nWe stayed there since check in and left at check out it was truly incredible. I will never forget it! Also the owner was really fast and reliable in responding\nOnly wish I would have had is to know a bit better on what kind of food we can bring as there is only a mini gas bottle and a grill',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Louisa','https://www.airbnb.ca/rooms/34692739/reviews','August 2021'),(2436,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very nice location, with a superb view. Good communication throughout. Would recommend!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Joachim','https://www.airbnb.ca/rooms/34692739/reviews','July 2021'),(2437,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing view and great atmosphere. Such a charming place to relax.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Martine','https://www.airbnb.ca/rooms/34692739/reviews','June 2021'),(2438,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing experience.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Athul S','https://www.airbnb.ca/rooms/34692739/reviews','May 2021'),(2439,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We had a lovely one night stay at the birdbox. We arrived to bright blue skies and sunshine, and woke up to a little bit of snow in the morning! This is a wonderful place to stay, whatever the weather :D',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Hannah','https://www.airbnb.ca/rooms/34692739/reviews','May 2021'),(2440,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfect place ?',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Evelina','https://www.airbnb.ca/rooms/34692739/reviews','May 2021'),(2441,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful view and perfect glamping experience!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Leslie','https://www.airbnb.ca/rooms/34692739/reviews','April 2021'),(2442,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','I have been impressed ',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Mantas','https://www.airbnb.ca/rooms/34692739/reviews','April 2021'),(2443,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','JUST DO IT!!! Weve been considering this for awhile now and we are so glad we made the trip to do it. It was the most relaxed we have been in quite some time. The entire set up was cozy and well thought out. The (Website hidden by Airbnb) AMAZING. I told my fianc we are getting one because this is hands down the best bed Ive ever slept in. Could have slept in here all day long.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Morgan','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2444,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfect??',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Violeta','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2445,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Torsteins bird box was everything and more than we wanted! Outrageously beautiful views no picture will benefit it. There is a fireplace outside and a little area where you prepare food or cook food on the fire. Extremely quick and helpful response time from Torstein. Already getting ready too book again',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Connor','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2446,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Surprised my girlfriend and our newborn with a stay at the Fauske Birdbox, March 14-15. The weather was perfect for sunset, starlit night sky and beautiful sunrise. Couldnt be happier with the decision!\n\nCommunication with Torstein and check-in/out was excellent.\n\nPerfect to spice up a roadtrip/vacation or as a surprise gift for someone special :)',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Aleksander','https://www.airbnb.ca/rooms/34692739/reviews','March 2021'),(2447,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Sure, it was beautiful and the location was great. There was access to small cabin with some amenities and a bathroom. Very photogenic.\n\nOur cabin was said on this page to have some source of heat, however we have now spent the night in a freezing cold \"Birdbox\". Of course we searched for ways to heat the place up, however the only oven we found was hidden under the bed behind some walls and obviously not meant for us to find or adjust. There were no higher settings on the oven either. This should obviously be clearly stated on their page on Airbnb as people do risk getting sick.\n\nThe birdbox was also filled with condensation and everything was completely wet, with water running down the windows that covered the walls.\n\nIkke verdt den stive prisen, med tanke p dugg, fukt og kulde som burde vre minimumsstandard. Veldig (Hidden by Airbnb) -vennlig da! Sikkert verdt det om vren/sommeren.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Erik','https://www.airbnb.ca/rooms/34692739/reviews','November 2020'),(2448,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great all over! Beautiful cabin with a stunning view.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Emilie','https://www.airbnb.ca/rooms/34692739/reviews','November 2020'),(2449,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very cozy place with a great view!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Stian','https://www.airbnb.ca/rooms/34692739/reviews','October 2020'),(2450,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nothing worthwhile in life is easy. If you want something spectacular be prepared to put the effort in and you will not be disappointed.\n\nThe elegantly simple design of what is essentially a bedroom (no, there is not an en suite) sits proudly on a landscape but doesnt compete or offend nature. This is a celebration of how beautiful Norway is and offers visitors the chance to lose themselves in wonder.\n\nThis is a place for one or maximum two people - it is just a large bed in a box. But what a place.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Alan','https://www.airbnb.ca/rooms/34692739/reviews','October 2020'),(2451,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was a truly lovely experience! One of a kind place to go to sleep and awaken to spectacular views. Highly recommend a visit.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Kelsey','https://www.airbnb.ca/rooms/34692739/reviews','October 2020'),(2452,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice view and its a perfect place to stay for a night',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Yasmeen','https://www.airbnb.ca/rooms/34692739/reviews','September 2020'),(2453,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The place have left for us amazing impression',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Tomas','https://www.airbnb.ca/rooms/34692739/reviews','September 2020'),(2454,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The view was absolutely amazing in the morning and throughout the day. lovely weekend gateway location locating in a stunning region of Norway.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Fanny','https://www.airbnb.ca/rooms/34692739/reviews','September 2020'),(2455,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','It\'s a sin to go to sleep before darkness!!! That view!!!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Baiba','https://www.airbnb.ca/rooms/34692739/reviews','September 2020'),(2456,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This birdbox cabin was absolutely incredible. The view was even better than expected, we had a great time. We stayed two nights and I think that was a great amount of time for people looking for a little getaway from reality. We highly recommend staying here, it was worth every cent.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Christine','https://www.airbnb.ca/rooms/34692739/reviews','September 2020'),(2457,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The birdbox is amazing! Location, the box itself and the view (especially during sunset) make it an unique experience.\nWe really enjoyed our stay there.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Julia','https://www.airbnb.ca/rooms/34692739/reviews','August 2020'),(2458,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great view and cozy cabin. For the short hike up to the box you definitely need to bring proper shoes if it rains!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Lena','https://www.airbnb.ca/rooms/34692739/reviews','August 2020'),(2459,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We spend our last night in the Birdbox and it was wonderful. By far the most spectacular night of our holiday and the view was fantastic. Torstein is also very easy to communicate with and provides you with all the information youll need to get there and have a nice stay.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Gijs','https://www.airbnb.ca/rooms/34692739/reviews','August 2020'),(2460,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful place, and a nice little cabin/box. I highly recommend it! The view is even better in real life!:)',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Erik','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2461,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing place, and an amazing view. Cozy little cabin, and a small functional kitchen located nearby. Tip top! :)',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Arnfinn','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2462,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing view and atmosphere! Loved our stay at this unique place. Fell asleep listening to raindrops tapping the ceiling and watched how the weather changed over the fjord.\n\nTip! We brought our own casserole and other cooking equipment to make food. There is no fridge there so bring a cooling bag if you have food that needs to be cold.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Metock','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2463,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Awesome views!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Moquan','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2464,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place is absolutely amazing! The view is maybe the best I have ever seen!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Torstein','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2465,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','An experience definitely worthwhile! Felt so close to nature, yet safe and warm inside the birdbox. Torstein is easy and quick to communicate with, and a great host. Will recommend it to friends and family for future excursions.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Alice','https://www.airbnb.ca/rooms/34692739/reviews','July 2020'),(2466,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfect place to enjoy nature with stunning view from our bed in a very relaxing and peaceful place. We definitely will go back!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Jose Eustaquio','https://www.airbnb.ca/rooms/34692739/reviews','June 2020'),(2467,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great view, great location, great host. All in all a great experience!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Eirik','https://www.airbnb.ca/rooms/34692739/reviews','May 2020'),(2468,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing view and a very comfy bed, make sure to bring walking boots as its a short but muddy walk, and ensure to go in the daylight as it was quite awkward in the dark! However the whole place made up for it ten times over, the view was out of this world and we would definitely go back again!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Rhys','https://www.airbnb.ca/rooms/34692739/reviews','January 2020'),(2469,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Magical place to sleep. View is amazing.\nAlthough we think this place is better in summer then winter because it very cold in winter and its getting dark sooner. The place is not easy to reach in the dark.This place is perfect for hikers and people who are used to do camping. There is no shower, its back to basic but its al very worth it!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Cheyenne','https://www.airbnb.ca/rooms/34692739/reviews','December 2019'),(2470,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','OMG! This place is insane! We had a great stay and the morning view of fjords and mountains will stay with us for years to come. Truly a magical experience!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Kevin','https://www.airbnb.ca/rooms/34692739/reviews','December 2019'),(2471,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If you are looking for a experience to remember this is the place. The location is outstanding, despite being just a room it was very confortable and cosy. Will recommend to anyone.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Willevans898','https://www.airbnb.ca/rooms/34692739/reviews','November 2019'),(2472,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A truly spectacular location. Words cant describe how beautiful the views are. Warm and cosy even during our stay at the end of October. We brought enough food and drink to last us a couple of nights but the nearest town isnt far away to stock up if youre staying a bit longer. Great communication from Torstein. Would highly recommend! One point to consider; best to arrive in the hours of daylight or bring a good torch!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Melissa','https://www.airbnb.ca/rooms/34692739/reviews','October 2019'),(2473,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing location, amazing views, especially inside of the bird box its breathtaking.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Lisandra','https://www.airbnb.ca/rooms/34692739/reviews','October 2019'),(2474,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wow, what an experience. A view we will never forget. Was truly amazing.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Nicola','https://www.airbnb.ca/rooms/34692739/reviews','September 2019'),(2475,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place is amazing.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Hsiang Hsuan','https://www.airbnb.ca/rooms/34692739/reviews','September 2019'),(2476,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A fantastic glamping experience, highly recommended for a stay somewhere out of the ordinary. The sunset and dawn views were beautiful.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'David','https://www.airbnb.ca/rooms/34692739/reviews','September 2019'),(2477,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Awesome space, made even moodier by the weather. Great stay, would definitely recommend. Good boots needed to get up there in the wet, but well worth it! Thanks!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Chris','https://www.airbnb.ca/rooms/34692739/reviews','September 2019'),(2478,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We loved our stay at the Birdbox - it was beautiful and really an interesting space. We had all we needed and loved watching the sun come up over the fjords. It was nice and warm, and the rain made it cozy. Wed love to stay again!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Alyssa','https://www.airbnb.ca/rooms/34692739/reviews','September 2019'),(2479,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The real landscape box',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Ryo','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2480,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing view and overall outdoor experience. Loved the cows nearby and the comfortable bed. Highly recommend this to other visitors.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Erin','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2481,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The view from this place is unbelievable! The bed is super comfortable and the room is very stylish. It is a great place to go glamping!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Eileen','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2482,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The Bird Box is an unforgettable, one of a kind experience. The view at dusk and dawn is worth every inch of the muddy hike up. So glad we did this. Highly recommend.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Andrew','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2483,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','If you\'re thinking about staying here go ahead and book it. This place is beautiful and I won\'t forget the views.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Brad','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2484,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We love unique airbnbs, so we booked this one :-) Our expectations have been exceeded, this place is truly unique and beautiful! Its a once in a lifetime experience. Watching the sunset and the moon during the night was amazing. Every morning we were woken up by some lovely sheep in front of our cabin and the cows were also very cute! The interior in the cabin is really comfy and its protected from the wind. However pack some warm clothes because its getting quite cold there during the night (4 degree in august :-D) and some hiking shoes to get up there. Thorstein, thank you for building and offering such a great place to other people!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Gabi','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2485,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Don\'t even think twice about it. We can guarantee that this\'ll be one of the most spectacular places you have ever slept. Just make sure you bring your rain boots and a good bottle of wine... This is one is a no brainer!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Ann Christin','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2486,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We leave our highest recommendations for Torstein!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Sarah','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2487,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Semt to be a great expericene.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Patricia','https://www.airbnb.ca/rooms/34692739/reviews','August 2019'),(2488,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great place to get away from everything. Can only recommend as the view is spectacular!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Niklas','https://www.airbnb.ca/rooms/34692739/reviews','July 2019'),(2489,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','A truly memorable experience! Secluded and idyllic location and lovely little touches from the host such as coffee/tea and candles. Already thinking about returning in the winter :)',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Mena','https://www.airbnb.ca/rooms/34692739/reviews','July 2019'),(2490,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The bird box is definitely unlike anywhere we\'ve stayed before!\n\nWe watched one of the best midnight sunsets of our lives against the mountains as we fell asleep. The view is incredible, even better than the pictures can show.\n\nBring some good hiking shoes, preferably water proof. It\'s a short hike to the box, only about 200 meters, but the path can be very muddy and the terrain uneven.\n\nIt may be a little rustic for some people\'s taste but I think that\'s obvious from the description and pictures. The view is definitely worth it though!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Ray','https://www.airbnb.ca/rooms/34692739/reviews','July 2019'),(2491,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Truly unique experience. Mind blowing view. Highly recommended!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Jack','https://www.airbnb.ca/rooms/34692739/reviews','July 2019'),(2492,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Amazing place to stay. Beautiful view from the bird box no matter what the weather is like. Nice comfortable bed great experience will definitely stay again',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Martin','https://www.airbnb.ca/rooms/34692739/reviews','June 2019'),(2493,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This place is truly outstanding. The pictures does not do this place justice. It is even better. We were a bit unprepared for the little walk up to the box as was raining a lot and the grass was really wet and damp. Torstein gave us the heads up so we could use the simple yet effective solution of plastic bags on feet. Really appreciated. Really highly recommendthis place. Stunning views and a different stay for a perfect memory with my husband.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Nancy','https://www.airbnb.ca/rooms/34692739/reviews','June 2019'),(2494,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','This was a magical experience! I spent an evening and night watching the changing weather and the shifting of light, comfortly inside the birdbox, with a beautiful view of the mountains and fjord. And with cows and sheeps grazing in the green hillside just below the box. The interior was high quality, very comfortable! The toilet in the summerbarn located just nearby was a nice, clean and practical solution. The short hike up to the birdbox was easy, just long enough to give a hideaway-feeling. This is unique, life felt so uncomlicated here, and I highly recommend a stayover.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Liv-Anne','https://www.airbnb.ca/rooms/34692739/reviews','June 2019'),(2495,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Une vue incroyable !',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Clara','https://www.airbnb.ca/rooms/34692739/reviews','May 2022'),(2496,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Den nydelegaste utsikta!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Gro','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2497,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Utrolig koselig birdbox med fantastisk utsikt.\nGodt laget til med toalett og en enkel, men praktisk kjkkenkrok.\nFin plass til  bruke stormkjkken utenfor birdboxen. Kommer gjerne igjen!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Charlotte','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2498,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Lisbet','https://www.airbnb.ca/rooms/34692739/reviews','April 2022'),(2499,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Vi hadde det helt magisk! Var s heldig  f med oss en nyydelig rd solnedgang. Enorm seng  boltre og kose seg i. Utsikt hvor enn vi s! Veldig bra laget til med kjkk