d primus til  varme vann til kaffe, vask eller andre ting. Eneste problemet vi hadde var at veien opp til parkeringsplassen var svrt bratt og glatt, s vi kom oss ikke helt opp. Men vi fikk hjelp av en nabo, og fikk parkere ved en fjs lenger ned i bakken. Alt i alt en uforglemmelig opplevelse.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Frank Willy','https://www.airbnb.ca/rooms/34692739/reviews','February 2021'),(2562,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Flott hytte og beliggenhet. Vi har kost oss med brettspill (medbragt) og utsikten ??\n\nDo/kjkkenfasiliteter er forbedringspotensial. Lurt  ta med stvler/fjellsko da det er gjrmete opp til hytta.',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Mali','https://www.airbnb.ca/rooms/34692739/reviews','December 2020'),(2563,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Vi hadde ei herleg oppleving i birdboxen. Veiret var flott og utsikta var s fantastisk at vi vart heilt oppslukt. Vi hadde med eigen gassbrennar og anna utstyr til  lage mat. Det er ein sommarfjs like ved med ein benk vi brukte til  lage mat. Det var godt  kome seg vekk litt i desse tider og f oppleve noko nytt utan  mtte reise s langt. Anbefalast!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Astrid','https://www.airbnb.ca/rooms/34692739/reviews','December 2020'),(2564,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Utrulig flott opplevelse, med ein fantastisk utsikt. Kan virkelig anbefales',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-17 05:03:23',0,1,NULL,'Jon','https://www.airbnb.ca/rooms/34692739/reviews','December 2020'),(2565,0,12,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Fantastisk opplevelse! Lett  finne, varmt og koselig i Bird boxen. Vi koste oss med den flotte utsikten. Hadde med oss snnen vr p 1 r som synes at det var veldig stas  se ut gjennom alle vinduene og hoppe i den store senga :) Anbefales!',4.87,NULL,0,0,'2022-05-17 05:03:23','2022-05-