en mchtest, frag einfach die Nachbarn, die vorbeikommen, und sie werden wirklich freundlich mit dir kommen. Es gibt hier eine Menge Airbnb-Unterknfte.)\nEs gibt auch einen groen Lebensmittelladen innerhalb von 5-10 Gehminuten.\nMir hat es gefallen, weil es viele Arten von Dingen gab und es billig war!\nAn der gleichen Stelle wie die Zukshupeche Ticket Boothsdu (?)\nDu kannst in krzester Zeit dorthin kommen, Job.\nDie Waschmaschine ist auch frei verfgbar, so dass es gut ist.\nGute Lage,\nsauberes Gebude & Zimmer\nFreundlicher Gastgeber & Nachbar',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'','https://www.airbnb.de/rooms/48268802/reviews','September 2022'),(2911,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsas Haus ist super komfortabel und groartig gelegen. Es war ein wenig schwierig einzuchecken, vor allem, weil die Strae im Bau war, aber Elsa war sehr reaktionsschnell. Wir liebten den kostenlosen Parkplatz auf der Strae! Die Unterkunft ist super sauber und mit allem Notwendigen ausgestattet. Wir wrden auf jeden Fall wieder hier bernachten!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Andrea','https://www.airbnb.de/rooms/48268802/reviews','September 2022'),(2912,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ich habe eine tolle Zeit bei Elsa verbracht. Die Wohnung ist nur wenige Gehminuten von der Bushaltestelle und dem Bahnhof entfernt. Ganz in der Nhe eines Lebensmittelgeschfts. Die Lage ist fantastisch. Elsa war jederzeit erreichbar, wenn ich Fragen hatte, ob es nun darum ging, meinen Weg zur Wohnung zu finden oder die Waschmaschine zu benutzen. Die Wohnung war sehr gemtlich und komfortabel, ich fhlte mich wie zu Hause. Leider habe ich Elsa und ihre Tochter nicht kennengelernt, vielleicht das nchste Mal!! Ich wrde sehr empfehlen, whrend deiner Reise nach Garmisch-Partenkirchen bei Elsa zu wohnen!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Shreya','https://www.airbnb.de/rooms