age, in der Nhe des Bahnhofs.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Svevan','https://www.airbnb.de/rooms/48268802/reviews','Juli 2021'),(2951,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsas Wohnung ist wunderschn. Die Lage ist perfekt, wenn du kein Auto hast und auf die ffentlichen Verkehrsmittel angewiesen bist. Die Kommunikation mit Elsa verlief ebenfalls sehr reibungslos und sie war ziemlich flexibel beim Check-in und Check-out. Kann ich nur empfehlen :)',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Jyotsna','https://www.airbnb.de/rooms/48268802/reviews','Juli 2021'),(2952,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wunderbarer Aufenthalt bei Elsa. Sie war sehr entgegenkommend zu meinem variable Zeitplan und half mir beim Nahverkehr. Ich kann es nur wrmstens empfehlen!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Franklin','https://www.airbnb.de/rooms/48268802/reviews','Juli 2021'),(2953,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Ich hatte einen angenehmen Aufenthalt bei Elsa. Ganz in der Nhe des GaPa Bahnhofs. Gerne an dem Tag ankommen, an dem das WLAN repariert wurde:). Wrde ich auf jeden Fall empfehlen.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Srivathsan','https://www.airbnb.de/rooms/48268802/reviews','Juni 2021'),(2954,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Stefan','https://www.airbnb.de/rooms/48268802/reviews','Juni 2021'),(2955,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsa ist eine groartige Gastgeberin und sehr gesellig. Ihre Wohnung ist zentral und sehr sauber. Wir hatten einen sehr angenehmen Aufenthalt in ihrer Unterkunft.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Mary','https://www.airbnb.de/rooms/48268802/reviews','Mai 2021'),(2956,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Elsa war super nett und rief sogar eine Freundin von ihr an, um mir Ratschlge zu einem Wandern zu geben:)\nWohnung sehr sauber in einer super schnen Residenz',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Aurlien','https://www.airbnb.de/rooms/48268802/reviews','Mai 2021'),(2957,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Das Zimmer ist sehr sauber und in der Nhe des Bahnhofs in sehr guter Lage. Elsa ist sehr freundlich und ihre Tochter ist sehr s. Ich werde wieder darin leben, wenn ich in Zukunft nach Garmisch komme.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Xiyu','https://www.airbnb.de/rooms/48268802/reviews','Mai 2021'),(2958,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Unser Aufenthalt bei Elsa war groartig! Sie und ihre Tochter waren sehr nett, es war bedauerlich, dass wir nicht mehr Zeit hatten, uns zu unterhalten!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Sean','https://www.airbnb.de/rooms/48268802/reviews','Mai 2021'),(2959,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Es war eine schne Erfahrung mit Unterkunft in dieser Wohnung und Garmisch-Partenkirchen. Die Lage war auch perfekt. Es liegt in unmittelbarer Nhe zu einer Station und es gibt einen Supermarkt in der Nhe der Unterkunft. Es gibt kein WLAN, aber ich konnte das Internet leicht mit LAN-Kabel und Adapter nutzen, das sie mir zur Verfgung gestellt hat. Wenn du ein Alleinreisender bist, empfehle ich dir, hier zu bernachten.',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'Mitsuya','https://www.airbnb.de/rooms/48268802/reviews','Mai 2021'),(2960,0,29,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Die Lage ist nur wenige Gehminuten vom Bahnhof entfernt. Elsas Wohnung befindet sich in einer modernen Community. Es ist beeindruckend sauber und ordentlich, und alle Gerte, die du bentigst, findest du dort.\nElsa ist eine sehr freundliche Gastgeberin, sie hat mir auch einen Nachteil des Check-ins und Check-outs gegeben, was mir wirklich sehr hilft.\nDas Einzige, was ein wenig unangenehm sein knnte, ist, dass es derzeit nur ein LAN-Internet gibt (das in der Benachrichtigung geschrieben wurde). Auer, dass ich diese Unterkunft empfehle, wer einen Aufenthalt in Garmisch verbringen mchte!',4.92,NULL,0,0,'2023-08-11 04:33:19','2023-08-11 04:33:19',0,1,NULL,'','https://www.airbnb.de/rooms/48268802/reviews','April 2021'),(2977,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','The apartment was clean and in a very lovely, central location. The studio had a lot of great amenities and was perfect for a business trip. Johannes always communicated well and answered my questions. Would definitely stay again!!',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Sarah','https://www.airbnb.co.nz/rooms/37548154/reviews','August 2021'),(2978,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Loved my stay here! A super cozy apartment and brilliant location in the center of old town Regensburg. The Danube is a minute walk away, plus an easy walk to restaurants, shops, and all around the Altstadt. The hosts, Johannes and Daniela, were super accommodating. I look forward to returning again.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Melinda','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2020'),(2979,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Host greeted at check-in. Very friendly, courteous, and helpful. Stylish, comfortable apartment. Highly recommended!',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'John','https://www.airbnb.co.nz/rooms/37548154/reviews','August 2019'),(2980,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great location, easily accessible, cozy, bed a bit small for two people.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Raphael','https://www.airbnb.co.nz/rooms/37548154/reviews','December 2021'),(2981,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Beautiful apartment in a top location. The apartment is well equipped. For the central location it is very quiet, you don\'t get anything from downtown noise. The hosts are very friendly. Worth a visit!',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Dennis','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2021'),(2982,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Great apartment with flair. One room with bathroom. Plenty of space. EVERYTHING you need is there. Johannes super friendly, communicative, ATTENTIVE. Great location in the old town. There\'s no better way. Highly recommended.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Raphael','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2021'),(2983,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Perfect place, perfect location, super nice host, this is airbnb at its very best!',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Adam','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2021'),(2984,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Wonderfully suitable for a city trip, as the apartment is centrally located yet away from the hustle and bustle.\nIt has everything you need, good restaurants, shopping and the Danube are around the corner.\nCommunication was straightforward and the reception very nice. We would definitely come back !',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Kerstin','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2021'),(2985,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Johannes and Daniela are wonderful hosts. Uncomplicated communication and a feel-good apartment in the heart of Regensburg make the stay perfect. Really highly recommended - thanks!',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Helga','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2021'),(2986,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Very nice small apartment with a top central location and everything you ever need. We had a nice few days in Regensburg.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Joshua','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2021'),(2987,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super centrally located and cozy small apartment on the ground floor. You are immediately in the old town.\nJohannes and Daniela are also very nice and are at your disposal for questions.\nThe apartment is well appointed and clean, we will be happy to come back!',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Mika','https://www.airbnb.co.nz/rooms/37548154/reviews','August 2021'),(2988,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Top location, very friendly hosts, apartment has everything you need, even a washing machine and a coffee machine for shared use. Small touches like a super delicious chocolate and nibbles make a difference. Thanks for that :)',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Pia','https://www.airbnb.co.nz/rooms/37548154/reviews','August 2021'),(2989,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','We stayed in Regensburg for a week. Johannes\' apartment was exactly as described and is nicely centrally located in the middle of Old Town. We felt very comfortable.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Anna','https://www.airbnb.co.nz/rooms/37548154/reviews','October 2020'),(2990,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','In the middle of the city and yet quiet - great',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Peter','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2020'),(2991,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Nice little apartment in the middle of the city center. Everything is within walking distance. Lovingly furnished.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Cdric','https://www.airbnb.co.nz/rooms/37548154/reviews','September 2020'),(2992,0,32,'00001','66bb87a0-b5dc-11ea-ae50-ddbe5a0ce374','Super location, good value for money. Johannes could set the price higher because of the super location and spacious flat. Anything you need is present. Johannes responds quickly to messages, is a superhost.',4.94,NULL,0,0,'2023-10-07 14:09:10','2023-10-07 14:09:10',0,1,NULL,'Helma','https://www.airbnb.co.nz/rooms/37548154/reviews','August 2019');
