ptstadtbro oder eine Hauptstadtreprsentanz, aber auch Bros bei den Landesregierungen.\n\nLobbying ist ein Aspekt des ffentlichen politischen Entscheidungsprozesses in Demokratien und ist nicht per se eine unmoralische Praxis. Das Herantragen von Interessen an Entscheidungstrger gehrt zum Wesensmerkmal parlamentarischer Demokratie[4] und lsst sich dem intermediren Bereich zwischen Brger und Staat[5] zuordnen. Um Entscheidungen im Gesamtinteresse der Gesellschaft treffen zu knnen, mssen Politiker sich ber hochkomplexe Fragestellungen und Inhalte informieren. Dabei sind sie auf gut aufbereitete Informationen und Argumente verschiedener Interessengruppen angewiesen. Vice versa gehen Interessensvertretungen mit den Politikern in den Dialog, um politische Entscheidungsprozesse zu beeinflussen.\n\nKritisch wird angemerkt, dass Lobbyismus nur bei Einhaltung von regulierenden Verhaltenskodizes[6] oder mglichst groer Transparenz[7] positive Auswirkungen auf die demokratische Qualitt eines Staates hat. Insbesondere durch regelmig bekannt werdende Lobbyismus-Affren (kurz Lobby-Affren) wird das idealtypische Bild von Lobbyismus getrbt. In diesen werden in der Regel Politiker in Machtpositionen von Unternehmen mit Geld bestochen, um Politik im Sinne der Geldgeber zu machen. In solchen Fllen ist Lobbyismus eine Form von Korruption.\n\nDer Begriff Lobbyismus hat daher hufig eine negative Konnotation, sodass Lobbyisten selten unter diesem Begriff auftreten, sondern stattdessen euphemistische Bezeichnungen wie Consultant, Public Affairs Manager oder Policy Advisor verwenden.[8]\n\nLobbyismus wurde in Anlehnung an die Vierte Gewalt (Medien) auch als Fnfte Gewalt bezeichnet, da Medien einen ffentlichen Einfluss, die Interessenpolitik jedoch oft einen unbemerkten Einfluss auf die Gesellschaft und insbesondere die Staatsgewalt hat. ',1,'message',NULL,NULL,0,'2021-10-21 04:43:05','2021-11-06 16:04:43',NULL,NULL),(1032,2,'2db74700-b5dc-11ea-ae50-ddbe5a0ce374','sms dev 01',1,'message',NULL,